"use strict";(self.webpackChunkmy_blog=self.webpackChunkmy_blog||[]).push([[1477],{10:t=>{t.exports=JSON.parse('{"blogPosts":[{"id":"/deep-learning-bootcamp-with-pytorch","metadata":{"permalink":"/blog/deep-learning-bootcamp-with-pytorch","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/2022-10-02-deep-learning-bootcamp-with-pytorch/deep-learning-bootcamp-with-pytorch.md","source":"@site/blog/2022-10-02-deep-learning-bootcamp-with-pytorch/deep-learning-bootcamp-with-pytorch.md","title":"\uae40\uae30\ud604\uc758 \ub525\ub7ec\ub2dd \ubd80\ud2b8\ucea0\ud504 with \ud30c\uc774\ud1a0\uce58","description":"\uc18c\ubb38\ub09c \uba85\uac15\uc758 | \uae30\ucd08\ubd80\ud130 \uc218\uc2dd, \uc2e4\uc2b5\uae4c\uc9c0 \ub2f4\uc740 \uc62c\uc778\uc6d0 \ub525\ub7ec\ub2dd \uc785\ubb38 \uad50\uacfc\uc11c","date":"2022-10-02T00:00:00.000Z","formattedDate":"2022\ub144 10\uc6d4 2\uc77c","tags":[{"label":"Book Review","permalink":"/blog/tags/book-review"}],"hasTruncateMarker":true,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\uace0 \uc788\ub294 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"\uae40\uae30\ud604\uc758 \ub525\ub7ec\ub2dd \ubd80\ud2b8\ucea0\ud504 with \ud30c\uc774\ud1a0\uce58","date":"2022-10-02","authors":"teddygood","tags":["Book Review"],"draft":false,"slug":"/deep-learning-bootcamp-with-pytorch","description":"\uc18c\ubb38\ub09c \uba85\uac15\uc758 | \uae30\ucd08\ubd80\ud130 \uc218\uc2dd, \uc2e4\uc2b5\uae4c\uc9c0 \ub2f4\uc740 \uc62c\uc778\uc6d0 \ub525\ub7ec\ub2dd \uc785\ubb38 \uad50\uacfc\uc11c","keywords":["\uc18c\ubb38\ub09c \uba85\uac15\uc758","\ud30c\uc774\ud1a0\uce58","\ub525\ub7ec\ub2dd"]},"nextItem":{"title":"\ub370\uc2f8\ub178\ud2b8\uc758 \uc2e4\uc804\uc5d0\uc11c \ud1b5\ud558\ub294 \uba38\uc2e0\ub7ec\ub2dd","permalink":"/blog/ML-in-practice"}},"content":":::info\\n\ud55c\ube5b\ubbf8\ub514\uc5b4 <\ub098\ub294 \ub9ac\ubdf0\uc5b4\ub2e4> \ud65c\ub3d9\uc744 \uc704\ud574\uc11c \ucc45\uc744 \uc81c\uacf5\ubc1b\uc544 \uc791\uc131\ub41c \uc11c\ud3c9\uc785\ub2c8\ub2e4.\\n:::\\n\\n![\ub098\ub294 \ub9ac\ubdf0\uc5b4\ub2e4 2022](../assets/I-am-reviewer-2022.jpg)\\n\\n## Book Info\\n\\n:::tip\\n\ucc45 \uc774\ubbf8\uc9c0\ub97c \ud074\ub9ad\ud558\uba74 \uad50\ubcf4\ubb38\uace0 \uc0ac\uc774\ud2b8\ub85c \uc774\ub3d9\ud569\ub2c8\ub2e4!\\n:::\\n\\n[![\ucc45](../assets/review/deep-learning-bootcamp-with-pytorch.jpg)](https://www.kyobobook.co.kr/product/detailViewKor.laf?ejkGb=KOR&mallGb=KOR&barcode=9791169210140&orderClick=LEa&Kc=)\\n\\n- \uc81c\ubaa9: \ud63c\uc790 \uacf5\ubd80\ud558\ub294 \ucef4\ud4e8\ud130 \uad6c\uc870+\uc6b4\uc601\uccb4\uc81c\\n- \uc800\uc790: \uac15\ubbfc\ucca0\\n- \ucd9c\ud310\uc0ac: \ud55c\ube5b\ubbf8\ub514\uc5b4\\n- \ucd9c\uac04: 2022-08-16\\n\\n\x3c!--truncate--\x3e\\n\\n## Intro\\n\\n\uc694\uc998\uc740 \ub525\ub7ec\ub2dd\uc744 \ub2e4\ub8ec \ucc45\uc774 \uc815\ub9d0 \ub9ce\uc774 \uc99d\uac00\ud588\uc2b5\ub2c8\ub2e4. \uadf8\ub7f0 \ucc45\ub4e4\uc740 \ub2e8\uc21c\ud788 \uc8fc\ud53c\ud130 \ub178\ud2b8\ubd81\uc73c\ub85c \uad6c\uc131\ub418\uace0, \uc2e4\ubb34\uc801\uc778 \ubd80\ubd84\uc5d0\uc11c \uc124\uba85\uc774 \ubd80\uc871\ud55c \uacbd\uc6b0\uac00 \ub9ce\ub2e4\uace0 \ub290\uaf08\uc2b5\ub2c8\ub2e4. \uadf8\ub7ec\ub098 \uc774 \ucc45\uc740 \uc2e4\ubb34\uc5d0 \ubc00\uc811\ud558\uac8c \ub525\ub7ec\ub2dd\uc744 \uacbd\ud5d8\ud574\ubcfc \uc218 \uc788\ub2e4\ub294 \uc810\uc774 \ub2e4\ub978 \ucc45\ub4e4\uacfc \ucc28\uc774\uc810\uc774\ub77c\uace0 \uc0dd\uac01\ud558\uc5ec \uc77d\uc5b4\ubcf4\uac8c \ub410\uc2b5\ub2c8\ub2e4.\\n\\n## Book Review\\n\\n### \uc27d\uac8c \uc124\uba85\ud558\ub294 \ucc45\\n\\n\uc2dc\uc911\uc5d0 \ub098\uc628 \ub525\ub7ec\ub2dd \ucc45 \uc911 \uaf64 \uac04\ub2e8\ud558\uac8c \uc124\uba85\ud569\ub2c8\ub2e4. \ub525\ub7ec\ub2dd\uc744 \ucc98\uc74c \uacf5\ubd80\ud558\uc2dc\uace0 \ud30c\uc774\ud1a0\uce58\ub97c \ucc98\uc74c \uc0ac\uc6a9\ud558\uc2dc\ub294 \uc785\ubb38\uc790\uc5d0\uac8c \ucd94\ucc9c\ud558\uace0 \uc2f6\uc740 \uc815\ub3c4\uc785\ub2c8\ub2e4. \uc544\ubb34\ub798\ub3c4 \uc800\uc790\ubd84\uc774 \ud328\uc2a4\ud2b8\ucea0\ud37c\uc2a4\uc5d0\uc11c \uc790\uc5f0\uc5b4 \ucc98\ub9ac \ubc0f \ud30c\uc774\ud1a0\uce58 \uac15\uc758\ub97c \ud558\uace0 \uc788\uc73c\uc154\uc11c \uadf8\ub7f0\uc9c0 \uc5b4\ub835\uac8c \uc124\uba85\ud558\uc2dc\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \uc800\ub294 \ube44\uc804\uacf5\uc790\ub3c4 \ubbf8\uc801\ubd84 \uc218\uc900\uc758 \uc218\ud559\ub9cc \uc54c\uace0 \uc788\uace0 \ucf54\ub529\uc5d0 \uad00\uc2ec\uc774 \uc788\ub2e4\uba74 \uc774 \ucc45\uc744 \ud1b5\ud574 \ub525\ub7ec\ub2dd\uc744 \uacbd\ud5d8\ud574\ubcfc \uc218\ub3c4 \uc788\ub2e4\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4.\\n\\n### \uc2e4\ubb34 \ud504\ub85c\uc81d\ud2b8\\n\\n\uc774 \ucc45\uc740 \ucc55\ud130\ub9c8\ub2e4 \uc2e4\uc2b5\uc774 \uc788\uc73c\uba70 Chapter 15\uc5d0\uc11c\ub294 \uc2e4\ubb34 \ud658\uacbd\uc5d0\uc11c\uc758 \ud504\ub85c\uc81d\ud2b8 \uc5f0\uc2b5\uc744 \ud560 \uc218 \uc788\ub3c4\ub85d \uc124\uba85\ud569\ub2c8\ub2e4. \uc800\ub294 \ud2b9\ud788 \uc774 \ubd80\ubd84\uc774 \uac00\uc7a5 \uc778\uc0c1 \uae4a\uc5c8\ub358 \ubd80\ubd84\uc785\ub2c8\ub2e4.\\n\\n### \uadf8\ub2e4\uc74c \uacf5\ubd80\\n\\n\uac01 Chapter\ub9c8\ub2e4 **\ub9c8\uce58\uba70**\ub77c\ub294 \ubd80\ubd84\uc5d0\uc11c \uc800\uc790\uc758 \uc870\uc5b8\uacfc \uadf8\ub2e4\uc74c\uc5d0\ub294 \uc5b4\ub5a4 \uac78 \uacf5\ubd80\ud558\uba74 \uc88b\uc744\uc9c0, \uc694\uc57d \ub4f1\uc744 \uc124\uba85\ud569\ub2c8\ub2e4. \uac1c\uc778\uc801\uc73c\ub85c \uc774\ub807\uac8c \ub9e4 Chapter\ub9c8\ub2e4 \uae54\ub054\ud558\uac8c \uc815\ub9ac\ud558\ub294 \ubd80\ubd84\ub3c4 \uc88b\uc558\uc2b5\ub2c8\ub2e4.\\n\\n## \ub300\uc0c1 \ub3c5\uc790\\n\\n\uc800\ub294 \uc774 \ucc45\uc73c\ub85c \ub525\ub7ec\ub2dd\uc744 \ucc98\uc74c \uacf5\ubd80\ud558\uc154\ub3c4 \ubb34\ubc29\ud558\ub2e4\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4. \ub610\ud55c, \ub525\ub7ec\ub2dd\uc744 \uc54c\uace0 \uc788\uc9c0\ub9cc \uc8fc\ud53c\ud130 \ub178\ud2b8\ubd81\ub9cc \uacbd\ud5d8\ud574\ubcf4\uc2e0 \ubd84\ub4e4\uaed8\ub3c4 \ucd94\ucc9c\ud569\ub2c8\ub2e4. \uc694\uc998 \ub098\uc624\ub294 \uac70\uc758 \ubaa8\ub4e0 \uba38\uc2e0\ub7ec\ub2dd, \ub525\ub7ec\ub2dd \ucc45\ub4e4\uc774 \uc8fc\ud53c\ud130 \ub178\ud2b8\ubd81\uc5d0\uc11c \uc2e4\uc2b5\ud558\uc9c0\ub9cc, \uc774 \ucc45\uc740 \uac00\uc7a5 \uae30\ucd08 \ub2e8\uacc4\uc5d0\uc11c \uba38\uc2e0\ub7ec\ub2dd \ud504\ub85c\uc81d\ud2b8\ub97c \uac04\uc811\uc801\uc73c\ub85c \uacbd\ud5d8\uc2dc\ucf1c \uc904 \uc218 \uc788\ub294 \ucc45\uc774\uc5c8\uc2b5\ub2c8\ub2e4. \uadf8\ub807\uae30\uc5d0 \uae30\ucd08\uac00 \ubd80\uc871\ud55c \ub3c5\uc790\uc5d0\uac8c\ub3c4 \uc801\uc808\ud558\ub2e4\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4."},{"id":"/ML-in-practice","metadata":{"permalink":"/blog/ML-in-practice","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/2022-09-12-ML-in-practice/ML-in-practice.md","source":"@site/blog/2022-09-12-ML-in-practice/ML-in-practice.md","title":"\ub370\uc2f8\ub178\ud2b8\uc758 \uc2e4\uc804\uc5d0\uc11c \ud1b5\ud558\ub294 \uba38\uc2e0\ub7ec\ub2dd","description":"Must Have | \ud53c\ucc98 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1 + TOP 10 \uc54c\uace0\ub9ac\uc998 + \uc2e4\ubb34 \ub178\ud558\uc6b0\ub85c \uc775\ud788\ub294 \uc2e4\ubb34\ud615 \ubb38\uc81c\ud480\uc774 \ud574\ubc95\uc11c","date":"2022-09-12T00:00:00.000Z","formattedDate":"2022\ub144 9\uc6d4 12\uc77c","tags":[{"label":"Book Review","permalink":"/blog/tags/book-review"}],"hasTruncateMarker":true,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\uace0 \uc788\ub294 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"\ub370\uc2f8\ub178\ud2b8\uc758 \uc2e4\uc804\uc5d0\uc11c \ud1b5\ud558\ub294 \uba38\uc2e0\ub7ec\ub2dd","date":"2022-09-12","authors":"teddygood","tags":["Book Review"],"draft":false,"slug":"/ML-in-practice","description":"Must Have | \ud53c\ucc98 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1 + TOP 10 \uc54c\uace0\ub9ac\uc998 + \uc2e4\ubb34 \ub178\ud558\uc6b0\ub85c \uc775\ud788\ub294 \uc2e4\ubb34\ud615 \ubb38\uc81c\ud480\uc774 \ud574\ubc95\uc11c","keywords":["Machine Learning","\uba38\uc2e0\ub7ec\ub2dd","\ud53c\ucc98 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1"]},"prevItem":{"title":"\uae40\uae30\ud604\uc758 \ub525\ub7ec\ub2dd \ubd80\ud2b8\ucea0\ud504 with \ud30c\uc774\ud1a0\uce58","permalink":"/blog/deep-learning-bootcamp-with-pytorch"},"nextItem":{"title":"\ud63c\uc790 \uacf5\ubd80\ud558\ub294 \ucef4\ud4e8\ud130 \uad6c\uc870+\uc6b4\uc601\uccb4\uc81c","permalink":"/blog/computer-structure-and-OS-to-study-alone"}},"content":":::info\\n\uace8\ub4e0\ub798\ube57 \ucd9c\ud310\uc0ac\ub85c\ubd80\ud130 \ucc45\uc744 \uc81c\uacf5\ubc1b\uc544 \uc791\uc131\ud588\uc2b5\ub2c8\ub2e4.\\n:::\\n\\n## Book Info\\n\\n:::tip\\n\ucc45 \uc774\ubbf8\uc9c0\ub97c \ud074\ub9ad\ud558\uba74 \uad50\ubcf4\ubb38\uace0 \uc0ac\uc774\ud2b8\ub85c \uc774\ub3d9\ud569\ub2c8\ub2e4!\\n:::\\n\\n[![\ucc45](../assets/review/ML-in-practice.jpg)](http://www.kyobobook.co.kr/product/detailViewKor.laf?ejkGb=KOR&mallGb=KOR&barcode=9791191905014&orderClick=LEa&Kc=)\\n\\n- \uc81c\ubaa9: \ub370\uc2f8\ub178\ud2b8\uc758 \uc2e4\uc804\uc5d0\uc11c \ud1b5\ud558\ub294 \uba38\uc2e0\ub7ec\ub2dd\\n- \uc800\uc790: \uad8c\uc2dc\ud604\\n- \ucd9c\ud310\uc0ac: \uace8\ub4e0\ub798\ube57\\n- \ucd9c\uac04: 2022-07-08\\n\\n\x3c!--truncate--\x3e\\n\\n## Intro\\n\\n\uba54\uc77c\ud568\uc744 \uc0dd\uac01 \uc5c6\uc774 \uc77d\ub2e4\uac00 \uace8\ub4e0\ub798\ube57 \ucd9c\ud310\uc0ac\uc5d0\uc11c \ubd81\uc2a4\ud3ec\uc77c\ub7ec\ub97c \ubaa8\uc9d1\ud55c\ub2e4\ub294 \uba54\uc77c\uc744 \ubcf4\uac8c \ub410\uc2b5\ub2c8\ub2e4. \ucc98\uc74c \ucc45 \uc81c\ubaa9\uc744 \uc811\ud588\uc744 \ub54c\ub294 **\\"\uc544, \ub610 \uba38\uc2e0\ub7ec\ub2dd \ucc45 \ub098\uc624\ub294\uad6c\ub098\\"** \ub77c\ub294 \uc0dd\uac01\uc774\uc5c8\uc2b5\ub2c8\ub2e4. \uadf8\ub7ec\ub098 \ucc45\uc758 \uad6c\uc131\uc744 \ubcf4\uace0 \uc0dd\uac01\uc774 \uc870\uae08 \ubc14\ub00c\uc5c8\uc2b5\ub2c8\ub2e4. \uc9c0\uae08\uae4c\uc9c0 \uc81c\uac00 \uc77d\ub358 \uba38\uc2e0\ub7ec\ub2dd \ucc45\uacfc\ub294 \ub2e4\ub974\ub2e4\ub294 \ub290\ub08c\uc744 \ubc1b\uc558\uc73c\uba70 \uc77d\uc5b4\ubcf4\uace0 \uc2f6\ub2e4\uace0 \uc0dd\uac01\ud588\uae30\uc5d0 \ubd81\uc2a4\ud3ec\uc77c\ub7ec\uc5d0 \ub3c4\uc804\ud588\uc2b5\ub2c8\ub2e4.\\n\\n## Book Review\\n\\n### \uba38\uc2e0\ub7ec\ub2dd\uc5d0 \uc7ac\ubc0c\uac8c \uc811\uadfc\ud558\uae30 \uc88b\uc740 \ucc45\\n\\n\ubb38\uc81c\ub97c \ud574\uacb0\ud558\ub294 \uac78 \uc88b\uc544\ud558\ub294 \uc0ac\ub78c\uc774\ub77c\uba74 \uc88b\uc544\ud560 \uc218\ubc16\uc5d0 \uc5c6\ub294 \ucc45 \uad6c\uc131\uc785\ub2c8\ub2e4. \uac01 Chapter\ub9c8\ub2e4 \ub300\ub7b5 \uba38\uc2e0\ub7ec\ub2dd \uc54c\uace0\ub9ac\uc998\uc744 \uc18c\uac1c\ud558\uace0, \uba38\uc2e0\ub7ec\ub2dd \ubb38\uc81c\ub97c \uc815\uc758\ud558\uc5ec \uadf8 \ubb38\uc81c\ub97c \ud480\uc5b4\uac00\ub294 \uacfc\uc815\uc744 \ubcf4\uc5ec\uc90d\ub2c8\ub2e4. \uc774\ub7f0 \uacfc\uc815\uc5d0\uc11c \uba38\uc2e0\ub7ec\ub2dd \uc54c\uace0\ub9ac\uc998\uc758 \ubd80\uac00\uc801\uc778 \ub0b4\uc6a9\uc744 \ub354 \uc54c\ub824\uc8fc\ub294 \uad6c\uc131\uc785\ub2c8\ub2e4. \uba38\uc2e0\ub7ec\ub2dd\uc758 \uc804\uccb4\uc801\uc778 \uacfc\uc815\uc744 \uccb4\ud5d8\ud574\ubcfc \uc218 \uc788\uace0, \uc2e4\uc804 \ubb38\uc81c\ub97c \ud480\uc5b4\ubcf4\ub294 \ub290\ub08c\uc774\ub77c \uc815\ub9d0 \uc7ac\ubc0c\uac8c \uc77d\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\uc77c\ubc18\uc801\uc778 \uba38\uc2e0\ub7ec\ub2dd \ucc45\uc774\ub77c\uba74 \uc54c\uace0\ub9ac\uc998\uacfc \ubaa8\ub378\uc5d0 \ub300\ud574 \uc218\ud559\uc801\uc73c\ub85c \ud55c\ucc38 \uc124\uba85\ud558\ub294\ub370 \uc774 \ucc45\uc740 \ub2ec\ub790\uc2b5\ub2c8\ub2e4. \uc218\ud559\uc801\uc778 \ubd80\ubd84\uc740 \ucd5c\uc18c\ud654\ud558\uc5ec \uc124\uba85\ud569\ub2c8\ub2e4. \uadf8\ub7f0 \uc810\uc5d0\uc11c \uc77d\uae30 \ud3b8\ud588\uc2b5\ub2c8\ub2e4.\\n\\n### \ucd5c\uc2e0 \uba38\uc2e0\ub7ec\ub2dd \uc54c\uace0\ub9ac\uc998\\n\\n\uc774 \ucc45\uc740 \uba38\uc2e0\ub7ec\ub2dd\uc5d0\uc11c \uaf64 \uc790\uc8fc \uc0ac\uc6a9\ub418\ub294 10\uac00\uc9c0 \uc54c\uace0\ub9ac\uc998\uc744 \uac01\uac01 \ud55c Chapter\uc5d0 \uac78\uccd0 \uc124\uba85\ud569\ub2c8\ub2e4. \uc804 \ub2e4\ub978 8\uac1c\uc758 \uc54c\uace0\ub9ac\uc998\uc740 \uadf8\ub798\ub3c4 \uc720\uba85\ud558\uae30\uc5d0 \uc54c\uace0 \uc788\uc5c8\uc73c\ub098 \ucd5c\uadfc \uce90\uae00\uc5d0\uc11c \ud56b\ud558\ub2e4\ub294 XGBoost \uac19\uc740 \uc54c\uace0\ub9ac\uc998\uc740 \ub300\ub7b5 \ubcf4\uae30\ub9cc \ud588\uace0 \uacf5\ubd80\ud574\ubcf8 \uc801\uc740 \uc5c6\uae30\uc5d0 \uc774 \ucc45\uc774 \uad81\uae08\ud588\uc2b5\ub2c8\ub2e4. \ucc45\uc758 \uad6c\uc131\ub3c4 \uc2dc\uc911\uc5d0 \ub098\uc628 \ub2e4\ub978 \ucc45\uacfc \ub2ec\ub790\uc9c0\ub9cc, XGBoost\ub098 LightGBM \uac19\uc740 \uaf64 \ucd5c\uadfc \uc54c\uace0\ub9ac\uc998\uae4c\uc9c0 \ub2e4\ub8ec\ub2e4\ub294 \uc810\uc5d0\uc11c \uc774 \ucc45\uc744 \uc77d\uc5b4\ubcfc \uac00\uce58\uac00 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n### \uc544\uc26c\uc6b4 \uc624\ud0c8\uc790\\n\\n\uc77d\uc73c\uba74\uc11c \uc740\uadfc\ud788 \uc624\ud0c8\uc790\uac00 \ub208\uc5d0 \ubcf4\uc600\uc2b5\ub2c8\ub2e4. \ucc45\uc744 \ub9cc\ub4dc\ub294 \uac83\uc774 \ud56d\uc0c1 \uc644\ubcbd\ud560 \uc218\ub294 \uc5c6\uc9c0\ub9cc, \ub3c5\uc790\ub85c\uc11c\ub294 \uc544\uc26c\uc6c0\uc774 \ud070 \ubd80\ubd84\uc774\uc5c8\uc2b5\ub2c8\ub2e4. \uc5bc\ub978 \ub354 \ub9ce\uc774 \ud314\ub824\uc11c 2\uc1c4\uc5d0\ub294 \uc624\ud0c8\uc790\uac00 \uc218\uc815\ub418\uae30\ub97c \ubc14\ub78d\ub2c8\ub2e4.\\n\\n## \ub300\uc0c1 \ub3c5\uc790\\n\\n\uba38\uc2e0\ub7ec\ub2dd\uc5d0 \uc785\ubb38\ud558\ub294 \ucd08\ubcf4\uc790\ub97c \ub300\uc0c1\uc73c\ub85c \uc218\ud559 \ub610\ub294 \ud1b5\uacc4\uc801\uc778 \uc9c0\uc2dd\ubcf4\ub2e4\ub294 \uadf8\ub9bc\uc744 \uc0ac\uc6a9\ud558\ub294 \uc800\uc790\uc758 \ub178\ub825\uc774 \ucc45\uc5d0\uc11c \ubcf4\uc600\uc73c\ub098 \uac1c\ub150\uc744 \ucc98\uc74c\ubd80\ud130 \uc790\uc138\ud788 \uc54c\ub824\uc8fc\ub294 \ubc29\uc2dd\uc774 \uc544\ub2c8\uace0, \uc9c4\ud589\ud558\uba74\uc11c \uc54c\uace0\ub9ac\uc998\uc744 \uc124\uba85\ud558\ub294 \ubc29\uc2dd\uc740 \uba38\uc2e0\ub7ec\ub2dd\uc744 \ucc98\uc74c \uacf5\ubd80\ud558\ub294 \uc0ac\ub78c\uc5d0\uac8c\ub294 \uc5b4\ub824\uc6b8 \uc218 \uc788\uc744 \uac70\ub77c \uc0dd\uac01\ud569\ub2c8\ub2e4. \uadf8\ub7ec\ub098 \uba38\uc2e0\ub7ec\ub2dd\uc5d0 \uacbd\ud5d8\uc774 \uc788\uc73c\uc2e0 \ubd84\uc774\ub77c\uba74 \uc7ac\ubc0c\uac8c \uc77d\uc73c\uc2e4 \uc218 \uc788\uc744 \uac83 \uac19\uc2b5\ub2c8\ub2e4.\\n\\n\uba38\uc2e0\ub7ec\ub2dd \uc54c\uace0\ub9ac\uc998\ub9cc \ub2e4\ub8e8\ub294 \uac83\uc774 \uc544\ub2cc \uba38\uc2e0\ub7ec\ub2dd\uc758 \uc804\uccb4\uc801\uc778 \uacfc\uc815\uc774 \uad81\uae08\ud558\uc2e0 \ubd84\uaed8 \ucd94\ucc9c\ud569\ub2c8\ub2e4. \uc800\ub294 \uba38\uc2e0\ub7ec\ub2dd\uc5d0\uc11c \uc54c\uace0\ub9ac\uc998\ub3c4 \uc911\uc694\ud558\ub2e4\uace0 \uc0dd\uac01\ud558\uc9c0\ub9cc, \uac00\uc7a5 \uc911\uc694\ud55c \uac74 \ud559\uc2b5\ud558\uae30 \uc804 \ub370\uc774\ud130 \uc804\ucc98\ub9ac \uacfc\uc815\uc774\ub77c \uc0dd\uac01\ud569\ub2c8\ub2e4. \uc774 \ucc45\uc740 \uc54c\uace0\ub9ac\uc998\ub9cc \uc124\uba85\ud558\ub294 \uac83\uc774 \uc544\ub2c8\ub77c \ub370\uc774\ud130 \ud074\ub9ac\ub2dd, \ud53c\ucc98 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1, \uc2dc\uac01\ud654 \ub4f1\ub3c4 \ub2e4\ub8f9\ub2c8\ub2e4. \uc774\ub7f0 \uacfc\uc815\uc5d0\uc11c \uc815\ub9d0 \uc88b\uc740 \uafc0\ud301\uc744 \uc5bb\uc744 \uc218 \uc788\uc5b4 \uc88b\uc558\uc2b5\ub2c8\ub2e4."},{"id":"/computer-structure-and-OS-to-study-alone","metadata":{"permalink":"/blog/computer-structure-and-OS-to-study-alone","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/2022-09-11-computer-structure-and-OS-to-study-alone/computer-structure-and-OS-to-study-alone.md","source":"@site/blog/2022-09-11-computer-structure-and-OS-to-study-alone/computer-structure-and-OS-to-study-alone.md","title":"\ud63c\uc790 \uacf5\ubd80\ud558\ub294 \ucef4\ud4e8\ud130 \uad6c\uc870+\uc6b4\uc601\uccb4\uc81c","description":"\ud63c\uacf5 \uc2dc\ub9ac\uc988","date":"2022-09-11T00:00:00.000Z","formattedDate":"2022\ub144 9\uc6d4 11\uc77c","tags":[{"label":"Book Review","permalink":"/blog/tags/book-review"}],"hasTruncateMarker":true,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\uace0 \uc788\ub294 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"\ud63c\uc790 \uacf5\ubd80\ud558\ub294 \ucef4\ud4e8\ud130 \uad6c\uc870+\uc6b4\uc601\uccb4\uc81c","date":"2022-09-11","authors":"teddygood","tags":["Book Review"],"draft":false,"slug":"/computer-structure-and-OS-to-study-alone","description":"\ud63c\uacf5 \uc2dc\ub9ac\uc988","keywords":["\ucef4\ud4e8\ud130\uad6c\uc870","\uc6b4\uc601\uccb4\uc81c","\ud63c\uacf5","\ud63c\uc790 \uacf5\ubd80\ud558\ub294"]},"prevItem":{"title":"\ub370\uc2f8\ub178\ud2b8\uc758 \uc2e4\uc804\uc5d0\uc11c \ud1b5\ud558\ub294 \uba38\uc2e0\ub7ec\ub2dd","permalink":"/blog/ML-in-practice"},"nextItem":{"title":"WSL2\uc5d0\uc11c Jupyter Lab \uc2e4\ud589 \ubb38\uc81c","permalink":"/blog/Jupyter-lab-tcgetpgrp-failed"}},"content":":::info\\n\ud55c\ube5b\ubbf8\ub514\uc5b4 <\ub098\ub294 \ub9ac\ubdf0\uc5b4\ub2e4> \ud65c\ub3d9\uc744 \uc704\ud574\uc11c \ucc45\uc744 \uc81c\uacf5\ubc1b\uc544 \uc791\uc131\ub41c \uc11c\ud3c9\uc785\ub2c8\ub2e4.\\n:::\\n\\n![\ub098\ub294 \ub9ac\ubdf0\uc5b4\ub2e4 2022](../assets/I-am-reviewer-2022.jpg)\\n\\n## Book Info\\n\\n:::tip\\n\ucc45 \uc774\ubbf8\uc9c0\ub97c \ud074\ub9ad\ud558\uba74 \uad50\ubcf4\ubb38\uace0 \uc0ac\uc774\ud2b8\ub85c \uc774\ub3d9\ud569\ub2c8\ub2e4!\\n:::\\n\\n[![\ucc45](../assets/review/computer-structure-and-OS-to-study-alone.jpg)](https://www.kyobobook.co.kr/product/detailViewKor.laf?ejkGb=KOR&mallGb=KOR&barcode=9791162243091&orderClick=LEa&Kc=)\\n\\n- \uc81c\ubaa9: \ud63c\uc790 \uacf5\ubd80\ud558\ub294 \ucef4\ud4e8\ud130 \uad6c\uc870+\uc6b4\uc601\uccb4\uc81c\\n- \uc800\uc790: \uac15\ubbfc\ucca0\\n- \ucd9c\ud310\uc0ac: \ud55c\ube5b\ubbf8\ub514\uc5b4\\n- \ucd9c\uac04: 2022-08-16\\n\\n\x3c!--truncate--\x3e\\n\\n## Intro\\n\\n\ubc8c\uc368 \ub124 \ubc88\uc9f8 \uc77d\uc5b4\ubcf4\ub294 \ud63c\uacf5 \uc2dc\ub9ac\uc988 \ucc45\uc785\ub2c8\ub2e4. \uc774\ubc88\uc5d0\ub294 \ucef4\ud4e8\ud130 \uad6c\uc870\uc640 \uc6b4\uc601\uccb4\uc81c\ub97c \uc8fc\uc81c\ub85c \ub098\uc654\ub124\uc694. \uc800\ub294 \uc194\uc9c1\ud788 \ud63c\uacf5 \uc2dc\ub9ac\uc988\uac00 \ub108\ubb34 \uc27d\ub2e4\ub294 \uc774\uc720\ub85c \ubcc4\ub85c \uc88b\uc544\ud558\uc9c0 \uc54a\uc558\uc2b5\ub2c8\ub2e4. \uc804\uacf5\uc790 \uc785\uc7a5\uc5d0\uc11c\ub294 \ub354 \uc138\ubd80\uc801\uc778 \uac78 \uc6d0\ud558\uac8c \ub418\ub294 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \uadf8\ub7ec\ub098 \uba87\uba87 \ub2e4\uc591\ud55c \ucc45\uc744 \uc77d\uc5b4\ubcf4\ub2c8 \ud63c\uacf5 \uc2dc\ub9ac\uc988\ub9cc\ud07c \uc77d\uae30 \ud3b8\ud55c \ucc45\uc774 \uc5c6\uc5c8\uc2b5\ub2c8\ub2e4. \uc774\uc81c\ub294 \ube44\uc804\uacf5\uc790 \ub610\ub294 \ub9c9 \uacf5\ubd80\ud558\uae30 \uc2dc\uc791\ud558\ub294 \uc804\uacf5\uc0dd\uc5d0\uac8c \ub108\ubb34 \ub3c4\uc6c0\uc774 \ub418\ub294 \uc2dc\ub9ac\uc988\ub77c\uace0 \ub290\ub07c\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n## Book Review\\n\\n### \uc77d\uae30 \uc26c\uc6b4 \ucc45\\n\\n\ucef4\ud4e8\ud130 \uad6c\uc870\ub97c \ucc98\uc74c \uacf5\ubd80\ud558\uac8c \ub418\uba74 architecture\ub97c ARM \ub610\ub294 RISC-V\ub85c \ubc30\uc6b0\uac8c \ub418\ub294\ub370 \uc774 \ucc45\uc740 \uc785\ubb38\uc790\ub97c \ub300\uc0c1\uc73c\ub85c \ud558\ub2c8 \uadf8\ub7f0 \uc5b4\ub824\uc6b4 \uc9c0\uc2dd\uc740 \uac70\uc758 \ubc30\uc81c\ub418\uc5b4 \uc788\uc2b5\ub2c8\ub2e4. \ub108\ubb34 \ub514\ud14c\uc77c\ud558\uac8c CS \uc9c0\uc2dd\uc744 \uc54c\ub824\uc8fc\ub294 \ucc45\uc740 \uc544\ub2c8\ub77c\ub294 \uac81\ub2c8\ub2e4. \ub9cc\uc57d \uc774 \ucc45\uc774 \ub514\ud14c\uc77c\ud558\uace0 \uc27d\uac8c \uc124\uba85\ub418\uc5c8\ub354\ub77c\uba74 \ucc45 \ub450\uaed8\uac00 \uc5b4\ub9c8\uc5b4\ub9c8\ud588\uc744 \uac83\uc785\ub2c8\ub2e4.\\n\\n\uc815\ub9d0 \uaf2d \ud544\uc694\ud55c \ud544\uc218 \uc694\uc18c \uc989, \ud575\uc2ec\ub9cc \ub4e4\uc5b4\uac00 \uc788\uc73c\uba70 \uacf5\ubd80\ud558\uba74\uc11c \uc4f8\ub370\uc5c6\ub294 \uace0\ubbfc\uc744 \ud558\uc9c0 \uc54a\uac8c \ud574\uc90d\ub2c8\ub2e4. \uadf8\ub7f0 \uc810\uc5d0\uc11c \uc800\ub294 \uc774 \ucc45\uc774 \ub9e4\uc6b0 \uc77d\uae30 \uc26c\uc6e0\ub2e4\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4.\\n\\n### \uc774\ud574\ud558\uae30 \uc26c\uc6b4 \uadf8\ub9bc\\n\\n\ucd08\ubcf4\uc790\uac00 \uc774\ud574\ud558\uae30 \uc27d\ub3c4\ub85d \uadf8\ub9bc\uc73c\ub85c \ub9e4\uc6b0 \uc124\uba85\uc774 \uc798 \ub418\uc5b4 \uc788\uc2b5\ub2c8\ub2e4. \ucef4\ud4e8\ud130 \uad6c\uc870 \uac19\uc740 \uacbd\uc6b0\uc5d0\ub294 \ucc98\uc74c \uacf5\ubd80\ud558\uac8c \ub418\uba74 \uc5b4\ub5a4 \uad6c\uc870\ub85c \ub3cc\uc544\uac00\ub294\uc9c0 \uc21c\uc11c\uac00 \uc5b4\ub824\uc6b8 \uc218 \uc788\uc73c\ub098 \uc774 \ucc45\uc740 \uccab \uc7a5\ubd80\ud130 \uc0bd\ud654\ub85c \uc798 \ud45c\ud604\uc774 \ub418\uc5b4 \uc788\uae30\uc5d0 \uc5b4\ub835\uc9c0 \uc54a\uc558\uc2b5\ub2c8\ub2e4.\\n\\n### \ud63c\uc790 \uacf5\ubd80\ud558\ub294 \uc0ac\ub78c\uc744 \uc704\ud55c \ucc45\\n\\n\ud63c\uc790 \uacf5\ubd80\ud558\uac8c \ub418\uba74 \uc790\uc2e0\uc774 \uacf5\ubd80\ud55c \uc9c0\uc2dd\uc774 \uc81c\ub300\ub85c \uba38\ub9ac\uc5d0 \ub0a8\uc558\ub294\uc9c0 \uc54c\uae30 \uc27d\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \uadf8\ub807\uae30\uc5d0 \uacf5\ubd80\ud55c \ud6c4\uc5d0 \uc9c0\uc2dd\uc744 \uc810\uac80\ud558\ub294 \uac83\uc740 \uaf2d \ud544\uc218\ub77c \uc0dd\uac01\ud569\ub2c8\ub2e4. \uc774 \ucc45\uc740 \uac01 \uc7a5\uc758 \ub9c8\uc9c0\ub9c9\uc5d0 \ub9c8\ubb34\ub9ac\ub85c \uc815\ub9ac\ub97c \ub2e4\uc2dc \ud574\uc8fc\uace0, \ud655\uc778 \ubb38\uc81c\ub97c \ud1b5\ud574 \uc81c\ub300\ub85c \uacf5\ubd80\ud588\ub294\uc9c0 \uc810\uac80\ud560 \uc218 \uc788\uac8c \ud574\uc90d\ub2c8\ub2e4. \uc774\uac8c \ud63c\uacf5 \uc2dc\ub9ac\uc988\uc758 \uc7a5\uc810\uc774\ub77c \uc0dd\uac01\ud569\ub2c8\ub2e4.\\n\\n\ucc45\uc758 \ub9e8 \ub05d\uc5d0 \ubd80\ub85d\uc73c\ub85c \ud63c\uc790 \uacf5\ubd80\ud558\ub294 \uc0ac\ub78c\uc744 \uc704\ud55c \ud63c\uacf5 \uc6a9\uc5b4 \ub178\ud2b8\uac00 \uc788\uc2b5\ub2c8\ub2e4. \uc815\ub9d0 \ubcc4\uac70 \uc544\ub2c8\uc9c0\ub9cc, \uc815\ub9d0 \ucd9c\ud310\uc0ac\uac00 \ud63c\uc790 \uacf5\ubd80\ud558\ub294 \uc0ac\ub78c\uc744 \uc704\ud574 \ub178\ub825\ud558\uace0 \uc788\ub2e4\ub294 \ubaa8\uc2b5\uc774 \ubcf4\uc5ec\uc11c \uc7ac\ubc0c\uae30\ub3c4 \ud558\uace0, \uc774 \ucc45\uc744 \uc77d\ub294 \uc0ac\ub78c\uc5d0\uac8c\ub294 \ub3c4\uc6c0\uc774 \ub9ce\uc774 \ub418\uaca0\ub2e4\uace0 \uc0dd\uac01\ud588\uc2b5\ub2c8\ub2e4.\\n\\n## \ub300\uc0c1 \ub3c5\uc790\\n\\n\ucef4\ud4e8\ud130 \uad6c\uc870\uc640 \uc6b4\uc601\uccb4\uc81c \uc218\uc5c5\uc744 \uc120\ud589 \ud559\uc2b5\ud574\ubcf4\uace0 \uc2f6\uc740 2\ud559\ub144 \uc804\uacf5\uc0dd\uc5d0\uac8c \ucd94\ucc9c\ud569\ub2c8\ub2e4. \uc81c\uac00 \ucef4\ud4e8\ud130\uad6c\uc870, \uc6b4\uc601\uccb4\uc81c \uc218\uc5c5\uc744 \ub4e4\uc744 \ub54c \uc774 \ucc45\uc774 \uc65c \uc5c6\uc5c8\ub294\uc9c0 \uc544\uc27d\uae30\ub9cc \ud569\ub2c8\ub2e4. \uadf8\ub54c\ub85c \ub3cc\uc544\uac04\ub2e4\uba74 \uc218\uc5c5\ubcf4\ub2e4 \uc774 \ucc45\uc73c\ub85c \uba3c\uc800 \uacf5\ubd80\ub97c \uc2dc\uc791\ud588\uc744 \uac83\uc785\ub2c8\ub2e4.\\n\\n\ub610\ud55c, \uc694\uc998 \ub9ce\uc740 \ube44\uc804\uacf5\uc790\ub4e4\uc774 \uad6d\ube44 \ud559\uc6d0 \ub610\ub294 \ub2e4\uc591\ud55c \uad50\uc721 \ud504\ub85c\uadf8\ub7a8\uc744 \ud1b5\ud574 \uac1c\ubc1c\uc744 \uacf5\ubd80\ud558\uace0 \uc788\ub294 \uac78\ub85c \uc54c\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uadf8\ub7ec\ub098 \uadf8\ub7f0 \ud504\ub85c\uadf8\ub7a8\uc5d0\uc11c\ub294 CS \uacf5\ubd80\ub97c \uc815\ub9d0 \uac04\ub2e8\ud558\uac8c \ud558\ub294 \uacbd\uc6b0\uac00 \ub9ce\uc740 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \uc194\uc9c1\ud788 \uc800\ub294 \uadf8 \uc815\ub3c4\uc758 \uacf5\ubd80\ub85c\ub294 \ubd80\uc871\ud558\ub2e4\uace0 \uc0dd\uac01\ud558\ub294 \uc0ac\ub78c\uc73c\ub85c\uc11c \ud504\ub85c\uadf8\ub7a8\uc758 \uc218\uc5c5\uc744 \ub4e3\ub418, \uaf2d \ucc45\ub3c4 \uc77d\uc5b4\ubcf4\ub77c\uace0 \uad8c\ud569\ub2c8\ub2e4. \ub098\uc911\uc5d0 \ub2e4\uc2dc \ucc45 \ucd94\ucc9c\ud560 \uc77c\uc774 \uc788\ub354\ub77c\uba74 \uc774 \ucc45\uc73c\ub85c \ucef4\ud4e8\ud130\uad6c\uc870\uc640 \uc6b4\uc601\uccb4\uc81c\ub97c \uacf5\ubd80\ud574\ubcf4\ub77c\uace0 \ud560 \uac83 \uac19\uc2b5\ub2c8\ub2e4."},{"id":"/Jupyter-lab-tcgetpgrp-failed","metadata":{"permalink":"/blog/Jupyter-lab-tcgetpgrp-failed","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/2022-07-16-Jupyter-lab-tcgetpgrp-failed/Jupyter-lab-tcgetpgrp-failed.md","source":"@site/blog/2022-07-16-Jupyter-lab-tcgetpgrp-failed/Jupyter-lab-tcgetpgrp-failed.md","title":"WSL2\uc5d0\uc11c Jupyter Lab \uc2e4\ud589 \ubb38\uc81c","description":"Tcgetpgrp Failed","date":"2022-07-16T00:00:00.000Z","formattedDate":"2022\ub144 7\uc6d4 16\uc77c","tags":[{"label":"Problem Solving","permalink":"/blog/tags/problem-solving"}],"hasTruncateMarker":true,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\uace0 \uc788\ub294 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"WSL2\uc5d0\uc11c Jupyter Lab \uc2e4\ud589 \ubb38\uc81c","date":"2022-07-16","authors":"teddygood","tags":["Problem Solving"],"draft":false,"slug":"/Jupyter-lab-tcgetpgrp-failed","description":"Tcgetpgrp Failed","keywords":["Jupyter","WSL2","Jupyter Notebook","Jupyter Lab"]},"prevItem":{"title":"\ud63c\uc790 \uacf5\ubd80\ud558\ub294 \ucef4\ud4e8\ud130 \uad6c\uc870+\uc6b4\uc601\uccb4\uc81c","permalink":"/blog/computer-structure-and-OS-to-study-alone"},"nextItem":{"title":"Hugo PaperMod theme \ud3f0\ud2b8 \ubcc0\uacbd\ud558\uae30","permalink":"/blog/change-font-in-papermod"}},"content":"## \ubb38\uc81c\\n\\n\ubcf4\ud1b5 \uc8fc\ud53c\ud130 \ub178\ud2b8\ubd81 \ub610\ub294 \uc8fc\ud53c\ud130 \ub7a9\uc744 \uc0ac\uc6a9\ud560 \ub54c `jupyter notebook` \ub610\ub294 `jupyter lab`\uc774\ub77c\ub294 \uba85\ub839\uc5b4\ub97c \uce58\uace0 \ub4e4\uc5b4\uac04\ub2e4. \ubcf4\ud1b5\uc740 \ube0c\ub77c\uc6b0\uc800\uc640 \ud568\uaed8 \uc8fc\ud53c\ud130\uac00 \uc2e4\ud589\ub418\ub294\ub370 \ube0c\ub77c\uc6b0\uc800\uac00 \uc5f4\ub9ac\uc9c0\ub3c4 \uc54a\uace0 \uc8fc\ud53c\ud130\uac00 \uc2e4\ud589\ub410\ub294\uc9c0\ub3c4 \ubaa8\ub974\ub294 \ubb38\uc81c\ub97c \ub9cc\ub0ac\ub2e4.\\n\\n![\ubb38\uc81c](tcgetpgrp-failed.png)\\n\\nWSL2\uc5d0\uc11c Jupyter Lab\uc744 \uc2e4\ud589\uc2dc\ud0a4\uba74 \uc704\uc758 \uc5d0\ub7ec \ubb38\uc7a5\uc774 1\ucd08\ub3c4 \uc548 \ub418\uac8c \ube60\ub974\uac8c \uc0ac\ub77c\uc9c0\uace0 \uac11\uc790\uae30 \ud130\ubbf8\ub110\uc774 clear\ub418\ub294 \uc0c1\ud669\uc774\ub2e4. Jupyter \uc11c\ubc84\uac00 \ub3cc\uc544\uac00\uace0 \uc788\ub294\uc9c0\ub3c4 \uc54c \uc218\uac00 \uc5c6\uc5c8\ub2e4. \\n\\n![\uc8fc\ud53c\ud130 \ub85c\uadf8\uc778](jupyter-login.png)\\n\\n\ud639\uc2dc\ub098 \uc11c\ubc84\uac00 \uc791\ub3d9\ud558\uace0 \uc788\ub294 \uac83\uc77c \uc218\ub3c4 \uc788\uc73c\ub2c8 Jupyter \uc8fc\uc18c\uc778 `localhost:8888`\uc5d0 \uc811\uc18d\ud574\ubd24\ub2e4. \uc11c\ubc84\ub294 \uc81c\ub300\ub85c \uc791\ub3d9\ud558\uace0 \uc788\ub294 \uac83\uc744 \ud655\uc778. \uadfc\ub370 \ubb38\uc81c\ub294 \ud1a0\ud070 \uac12\uc744 \ubaa8\ub978\ub2e4\ub294 \uac83\uc774\ub2e4. \ubcf4\ud1b5 Jupyter\ub97c \uc2e4\ud589\uc2dc\ud0ac \ub54c \ud130\ubbf8\ub110\uc5d0\uc11c \ud1a0\ud070\uc744 \ucd9c\ub825\uc2dc\ucf1c \ubcf4\uc5ec\uc900\ub2e4. \uc6b0\ub9ac\ub294 \uadf8\uac78 \ubcf5\uc0ac, \ubd99\uc5ec\ub123\uae30\ub97c \ud558\uba74 \ub41c\ub2e4. \uadf8\ub7ec\ub098 \uc9c0\uae08 \uc0c1\ud669\uc740 \ud130\ubbf8\ub110 \uc870\ucc28\ub3c4 clear\ub418\uc5b4 \uc788\uc73c\ubbc0\ub85c \ud1a0\ud070 \uac12\uc744 \ubaa8\ub978\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n## \ud574\uacb0\\n\\n### \ubc29\ubc95 1\\n\\n```\\njupyter server list\\n```\\n\\n\uac00\uc7a5 \uc26c\uc6b4 \ubc29\ubc95\uc740 \ud130\ubbf8\ub110\uc744 \ud55c \uac1c \ub354 \uc5f4\uc5b4\uc11c \uc704\uc758 \uba85\ub839\uc5b4\ub97c \ub204\ub978 \ud6c4, \ud1a0\ud070 \uac12\uc744 \ud655\uc778\ud558\uc5ec \uc8fc\ud53c\ud130 \ub7a9\uc5d0 \uc811\uc18d\ud558\uba74 \ub41c\ub2e4.\\n\\n### \ubc29\ubc95 2\\n\\n\uadfc\ub370 \uc704\uc758 \ubc29\ubc95\uc73c\ub85c \uc4f0\uba74 \uc194\uc9c1\ud788 \ub108\ubb34 \ubd88\ud3b8\ud558\uace0 \uc65c \uc800\ub7f0 \ubb38\uc81c\uac00 \uc0dd\uacbc\ub294\uc9c0 \uad81\uae08\ud558\uc5ec stackoverflow\uc5d0\uc11c \uac80\uc0c9\uc744 \uc880 \ud574\ubd24\ub2e4. \uc815\ud655\ud55c \uc6d0\uc778\uc740 \ubaa8\ub974\uaca0\uc73c\ub098 \ub2e4\ub978 \ud574\uacb0 \ubc29\ubc95 \ud558\ub098\ub97c \uc54c \uc218 \uc788\uc5c8\ub2e4.\\n\\n```bash\\njupyter lab --no-browser\\n```\\n\\n\uac04\ub2e8\ud558\ub2e4. \uadf8\ub0e5 \uc704\uc758 \uba85\ub839\uc5b4\ub97c \uc2e4\ud589\uc2dc\ud0a4\uba74 \ub41c\ub2e4. \uc8fc\ud53c\ud130\ub97c \uc2e4\ud589\ub420 \ub54c \uac19\uc774 \ucf1c\uc9c0\ub294 \ube0c\ub77c\uc6b0\uc800\ub97c \uc0ac\uc6a9\ud558\uc9c0 \uc54a\uaca0\ub2e4\ub294 \uc758\ubbf8\uc774\ub2e4.\\n\\n\uadf8\ub7fc \uc5b4\ub5bb\uac8c \uc8fc\ud53c\ud130\uc5d0 \uc811\uc18d\ud574\uc57c \ud558\ub294\uac00?  \\n\\n\uc8fc\uc18c\ub294 \uc8fc\ud53c\ud130\ub97c \uc2e4\ud589\uc2dc\ud0a4\uba74 \ud130\ubbf8\ub110\uc5d0 \ub098\uc628\ub2e4. \uc989, \uc6b0\ub9ac\uac00 \uc9c1\uc811 \ube0c\ub77c\uc6b0\uc800\ub97c \ucf1c\uc11c \uc8fc\uc18c\ub97c \uc785\ub825\ud558\uba74 \ub41c\ub2e4. \\n\\n![\uc8fc\ud53c\ud130 \ub7a9](jupyter-lab.png)\\n\\n\uadf8\ub7fc \uc704\uc640 \uac19\uc774 \uc81c\ub300\ub85c \uc0ac\uc774\ud2b8\uc5d0 \uc811\uc18d\ud560 \uc218 \uc788\uac8c \ub41c\ub2e4.\\n\\n## Appendix\\n\\n![\uc8fc\ud53c\ud130 \ub7a9](github-issue-jupyter.png)\\n\\nGitHub\uc5d0 \uc788\ub294 [jupyter lab Repo\uc758 issue](https://github.com/jupyterlab/jupyterlab/issues/10413)\ub97c \ud655\uc778\ud558\ub2c8 \ub098\ub791 \uac19\uc740 \ubb38\uc81c\ub97c \uc811\ud55c \uc0ac\ub78c\uc774 \uc788\uc5c8\uace0 \ub204\uad70\uac00\uc758 \ub2f5\ubcc0\uc744 \ud655\uc778\ud560 \uc218 \uc788\uc5c8\ub2e4. \uadf8\uc758 \ub2f5\ubcc0\uc744 \ub300\ucda9 \uc694\uc57d\ud558\uba74 \uc8fc\ud53c\ud130\ub791\uc740 \uad00\ub828\uc774 \uc5c6\uc73c\uba70 WSL\uacfc \uad00\ub828\uc774 \uc788\ub2e4\uace0 \ud55c\ub2e4. \\n\\n\ub300\ub7b5\uc801\uc73c\ub85c \uc608\uc0c1\ud574\ubcf4\uba74 \uc544\ub9c8 WSL\uc740 CLI\ub85c \uc774\ub8e8\uc5b4\uc9c4 \ud658\uacbd\uc774\ub77c \ube0c\ub77c\uc6b0\uc800\uac00 \uc5c6\uc73c\ub2c8 \uac70\uae30\uc11c \ube0c\ub77c\uc6b0\uc800\ub97c \uc791\ub3d9\uc2dc\ud0a4\ub824\uace0 \ud560 \ub54c \ubb38\uc81c\uac00 \uc0dd\uae38 \uc218 \uc788\ub2e4\uace0 \uc0dd\uac01\ud55c\ub2e4. \\n\\n\ub354 \uc0dd\uac01\ud574\ubcf4\uba74 WSL \uc790\uccb4\uac00 \uc560\ucd08\uc5d0 \uac00\uc0c1\ud658\uacbd\uc774\ub77c \uac70\uae30\uc11c \uc791\ub3d9\uc2dc\ucf1c \uc2e4\uc81c \ud658\uacbd\uc758 \ube0c\ub77c\uc6b0\uc800\ub97c \uc5ec\ub294 \uac83\uc774 \ubb38\uc81c\uac00 \uc788\uc744 \uc218\ub3c4 \uc788\ub2e4\uace0 \uc0dd\uac01\uc774 \ub4e0\ub2e4. \\n\\n\uadfc\ub370 \uadf8\ub807\uae30\uc5d0\ub294 WSL\uc5d0\uc11c VS Code\ub294 \ub108\ubb34 \uc798 \uc791\ub3d9\uc774 \ub418\ub294\ub370? \uc9c4\uc9dc \uc774\uc720\ub97c \ubaa8\ub974\uaca0\ub2e4.\\n\\n\uc5b4\uca0c\ub4e0 \ub098\ub294 1\ubc88 \ubc29\ubc95\uc740 \uadc0\ucc2e\uc73c\ub2c8 WSL\uc5d0\uc11c Jupyter\ub97c \uc0ac\uc6a9\ud560 \uacbd\uc6b0\uc5d0\ub294 \uc544\ub9c8 2\ubc88 \ubc29\ubc95\uc744 \uc0ac\uc6a9\ud558\uc9c0 \uc54a\uc744\uae4c \uc2f6\ub2e4.\\n\\n## References\\n\\n>- [https://stackoverflow.com/questions/50882266/using-jupyter-with-windows-subsystem-for-linux](https://stackoverflow.com/questions/50882266/using-jupyter-with-windows-subsystem-for-linux)\\n>- [Jupyter Lab hangs on startup and then \'tcgetpgrp failed: Not a tty\' appears (in WSL2)](https://github.com/jupyterlab/jupyterlab/issues/10413)"},{"id":"/change-font-in-papermod","metadata":{"permalink":"/blog/change-font-in-papermod","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/2022-07-14-change-font-in-papermod/change-font-in-papermod.md","source":"@site/blog/2022-07-14-change-font-in-papermod/change-font-in-papermod.md","title":"Hugo PaperMod theme \ud3f0\ud2b8 \ubcc0\uacbd\ud558\uae30","description":"\ub098\ub214\uc2a4\ud018\uc5b4, D2Coding \uc801\uc6a9\ud558\uae30","date":"2022-07-14T00:00:00.000Z","formattedDate":"2022\ub144 7\uc6d4 14\uc77c","tags":[{"label":"Blog","permalink":"/blog/tags/blog"}],"hasTruncateMarker":true,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\uace0 \uc788\ub294 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"Hugo PaperMod theme \ud3f0\ud2b8 \ubcc0\uacbd\ud558\uae30","date":"2022-07-14","authors":"teddygood","tags":["Blog"],"draft":false,"slug":"/change-font-in-papermod","description":"\ub098\ub214\uc2a4\ud018\uc5b4, D2Coding \uc801\uc6a9\ud558\uae30","keywords":["PaperMod","Hugo","\ube14\ub85c\uadf8"]},"prevItem":{"title":"WSL2\uc5d0\uc11c Jupyter Lab \uc2e4\ud589 \ubb38\uc81c","permalink":"/blog/Jupyter-lab-tcgetpgrp-failed"},"nextItem":{"title":"\ud504\ub85c\uc138\uc2a4 \uac15\uc81c \uc885\ub8cc\ud558\uae30","permalink":"/blog/django-port-is-already-in-use"}},"content":"## Theme \ucee4\uc2a4\ud140\\n\\n```\\n.(site root)\\n\u251c\u2500\u2500 config.yml\\n\u251c\u2500\u2500 content/\\n\u251c\u2500\u2500 themes/PaperMod/\\n\u2514\u2500\u2500 layouts\\n    \u251c\u2500\u2500 partials\\n    \u2502   \u251c\u2500\u2500 comments.html\\n    \u2502   \u251c\u2500\u2500 extend_footer.html <---\\n    \u2502   \u2514\u2500\u2500 extend_head.html   <---\\n    \u2514\u2500\u2500 robots.txt\\n```\\n\\n\x3c!--truncate--\x3e\\n\\n\uc774\uc804\uc5d0\ub3c4 \ub9d0\ud588\ub4ef\uc774 PaperMod Theme\uc740 \ubb38\uc11c\ud654\uac00 \uaf64 \uc798 \ub418\uc5b4 \uc788\ub2e4. [FAQs](https://adityatelange.github.io/hugo-PaperMod/posts/papermod/papermod-faq/#custom-head--footer)\ub97c \ucc38\uace0\ud558\uba74 \uc0ac\uc774\ud2b8\uc758 head \ub610\ub294 footer\ub97c \ucee4\uc2a4\ud140\ud560 \uc0c1\ud669\uc774 \uc624\uba74 `extend_head`\ub77c\ub294 \ud30c\uc77c\uc744 \ub9cc\ub4e4\uc5b4\uc11c \uadf8\uacf3\uc5d0\ub2e4 \ucd94\uac00\ud560 \ub0b4\uc6a9\uc744 \ucd94\uac00\ud558\ub77c\uace0 \uc801\ud600\uc788\ub2e4. \\n\\nHugo\ub294 \ube14\ub85c\uadf8\uc758 theme\uc744 \uc5b8\uc81c\ub4e0\uc9c0 \ucee4\uc2a4\ud140 \ud560 \uc218 \uc788\ub3c4\ub85d overriding\uc744 \uc9c0\uc6d0\ud55c\ub2e4. \uc989, submodule\ub85c \uc5f0\uacb0\ub41c `themes` \ud3f4\ub354\uc758 \ucf54\ub4dc\ub4e4\uc740 \uc218\uc815\ud558\uc9c0 \uc54a\uace0 \ub0b4 \ube14\ub85c\uadf8\uc758 \ucf54\ub4dc\ub4e4\ub9cc\uc744 \uc218\uc815\ud558\ub294 \uac83\uc774\ub2e4. \ud604\uc7ac \ube14\ub85c\uadf8 \ud30c\uc77c\uc5d0\ub3c4 `teddygood.github.io\\\\layouts\\\\partials\\\\extend_head`\uac00 \uc788\ub4ef\uc774 `themes` \ud3f4\ub354 \uc548\uc5d0\ub3c4 `themes\\\\PaperMod\\\\layouts\\\\partials\\\\extend_head.html`\uac00 \uc788\ub2e4.\\n\\n## \ud3f0\ud2b8 \uc801\uc6a9\\n\\n```html\\n{{- /* Head custom content area start */ -}}\\n{{- /*     Insert any custom code (web-analytics, resources, etc.) - it will appear in the <head></head> section of every page. */ -}}\\n{{- /*     Can be overwritten by partial with the same name in the global layouts. */ -}}\\n\\n...\\n\\n{{- /* D2Coding */ -}}\\n<link href=\\"//cdn.jsdelivr.net/gh/wan2land/d2coding/d2coding-full.css\\" rel=\\"stylesheet\\" />\\n\\n{{- /* Spoqa Han Sans Neo */ -}}\\n<link href=\'//spoqa.github.io/spoqa-han-sans/css/SpoqaHanSansNeo.css\' rel=\'stylesheet\' type=\'text/css\'>\\n\\n{{- /* NanumSquare */ -}}\\n<link href=\\"https://hangeul.pstatic.net/hangeul_static/css/nanum-square.css\\" rel=\\"stylesheet\\">\\n\\n{{- /* Head custom content area end */ -}}\\n\\n```\\n\\n\uc704\uc758 \ucf54\ub4dc\ub294 `extend_head` \ud30c\uc77c\uc774\ub2e4. \ucf54\ub4dc\ub97c \ubcf4\uba74 \uc54c \uc218 \uc788\ub4ef\uc774, head\uc5d0 \uc6f9 \ud3f0\ud2b8\ub97c \uc801\uc6a9\ud558\ub294 \ubc29\ubc95\uc744 \uc120\ud0dd\ud588\ub2e4. \\n\\n\ub098\ub214\uc2a4\ud018\uc5b4\uc640 Spoqa Han Sans Neo(\uc2a4\ud3ec\uce74 \ud55c \uc0b0\uc2a4 \ub124\uc624) \ud3f0\ud2b8 \uc911 \uc5b4\ub5a4 \ud3f0\ud2b8\ub97c \uc0ac\uc6a9\ud560\uc9c0 \uace0\ubbfc\ud588\uc5c8\ub294\ub370 \uacb0\uad6d \ub098\ub214\uc2a4\ud018\uc5b4\ub97c \uc120\ud0dd\ud558\uac8c \ub410\ub2e4. \uc2a4\ud3ec\uce74 \ud55c \uc0b0\uc2a4 \ub124\uc624 \ud3f0\ud2b8\ub098 \ub098\ub214\uc2a4\ud018\uc5b4\ub098 \ub458 \ub2e4 \ucda9\ubd84\ud788 \uac00\ub3c5\uc131\uc774 \uc88b\uc740 \ud3f0\ud2b8\ub77c\uace0 \uc0dd\uac01\ud55c\ub2e4. \uadf8\ub7ec\ub098 \ub098\ub214\uc2a4\ud018\uc5b4\uac00 \uc880 \ub354 \ub0b4 \ucde8\ud5a5\uc774\ub2e4. \\n\\n\uc774\ub7f0 \uace0\ubbfc\uc744 \ud558\uac8c \ub41c \uc774\uc720\uac00 \ub610 \uc788\uc5c8\ub294\ub370 \uae30\uc874\uc5d0 \uc4f0\uace0 \uc788\ub358 \ub098\ub214\uc2a4\ud018\uc5b4\uac00 \uc587\ub2e4\ub294 \ub290\ub08c\uc744 \ubc1b\uc558\uae30 \ub54c\ubb38\uc774\ub2e4. \uc774\uc804 \ube14\ub85c\uadf8\uc758 \ud3f0\ud2b8\ub97c \uadf8\ub300\ub85c \uc0ac\uc6a9\ud588\uc5c8\ub294\ub370 \uc774\uc720\ub294 \uc798 \ubaa8\ub974\uaca0\uc9c0\ub9cc \uacc4\uc18d \ud3f0\ud2b8\uac00 \uc587\ub2e4\ub294 \ub290\ub08c\uc744 \ubc1b\uc558\ub2e4. \uc544\ubb34\ub798\ub3c4 \ube44\uacf5\uc2dd\uc801\uc778 \uc6f9\ud3f0\ud2b8\ub97c \uc0ac\uc6a9\ud574\uc11c \uadf8\ub7f0 \uac74 \uc544\ub2d0\uae4c \uc2f6\ub2e4. \uc774\uc804\uc5d0\ub294 \ub098\ub214\uc2a4\ud018\uc5b4 \uc6f9 \ud3f0\ud2b8\uac00 \uc5b4\ub528\ub294\uc9c0 \ubab0\ub77c\uc11c GitHub\uc5d0\uc11c \ub204\uad70\uac00 \ub9cc\ub4dc\uc2e0 \uc6f9 \ud3f0\ud2b8\ub97c \uc0ac\uc6a9\ud588\uc5c8\ub2e4. \ud604\uc7ac\ub294 [\ub124\uc774\ubc84 \uae00\uaf34 \ubaa8\uc74c](https://hangeul.naver.com/2021/fonts/nanum)\uc5d0\uc11c \uacf5\uc2dd\uc801\uc73c\ub85c \ubc30\ud3ec\ud558\ub294 \uc6f9 \ud3f0\ud2b8\ub97c \uc0ac\uc6a9\ud55c\ub2e4. \\n\\nD2Coding \ud3f0\ud2b8\ub294 \uc9c0\uae08\ub3c4 \ubb38\uc81c \uc5c6\uc774 \uc0ac\uc6a9\ud558\uc5ec \uc774\uc804 \ube14\ub85c\uadf8\uc758 \uc6f9 \ud3f0\ud2b8\ub97c \uadf8\ub300\ub85c \uac00\uc838\uc654\ub2e4.\\n\\n```\\n.(site root)\\n\u251c\u2500\u2500 config.yml\\n\u251c\u2500\u2500 content/\\n\u251c\u2500\u2500 theme/hugo-PaperMod/\\n\u2514\u2500\u2500 assets/\\n    \u2514\u2500\u2500 css/\\n        \u2514\u2500\u2500 extended/  <---\\n            \u251c\u2500\u2500 custom_css1.css <---\\n            \u2514\u2500\u2500 any_name.css   <---\\n```\\n\\n\ub9c8\uc9c0\ub9c9\uc73c\ub85c \uc801\uc6a9\ud574\uc57c \ud560 \ubd80\ubd84\uc740 \ub2f9\uc5f0\ud788 CSS\uc774\ub2e4. CSS\ub294 `assets\\\\css\\\\extended\\\\custom.css` \uacbd\ub85c\uc5d0 \ub9cc\ub4e4\uba74 \uc801\uc6a9\uc774 \ub41c\ub2e4.\\n\\n```css\\nbody {\\n    font-family: \\"NanumSquare\\", \\"Spoqa Han Sans Neo\\", Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', -apple-system, BlinkMacSystemFont, \'Segoe UI\', sans-serif;\\n    font-size: 20px;\\n    line-height: 32px;\\n    word-break: break-word;\\n    background: var(--theme);\\n}\\n\\ncode {\\n    font-family: \\"D2Coding\\", monospace;\\n}\\n```\\n\\n\uc704\uc758 CSS \ucf54\ub4dc\ub294 \ud604\uc7ac \uc774 \ube14\ub85c\uadf8\uc5d0 \uc801\uc6a9\ub418\uace0 \uc788\ub2e4. \ud3f0\ud2b8\ub294 \uac00\uc7a5 \uc55e\uc5d0 \uc624\ub294 \uac83\uc774 \uc801\uc6a9\ub41c\ub2e4.\\n\\n## \uac04\ub2e8\ud55c \uc0dd\uac01 \\n\\n\ucd08\uae30\uc5d0 \uc774 \ud14c\ub9c8\ub97c \uc0ac\uc6a9\ud558\uc5ec \ube14\ub85c\uadf8\ub97c \ub9cc\ub4e4 \ub54c\ub294 \ubb38\uc11c\ud654\uac00 \uc5c4\uccad \uc798 \ub418\uc5b4 \uc788\uc9c0\ub294 \uc54a\uc544 GitHub PaperMod Repository\uc758 issue\uc5d0\uc11c \ud544\uc694\ud55c \uc815\ubcf4\ub4e4\uc744 \uc5bb\uc5c8\ub2e4. \uc9c0\uae08\uc740 PaperMod theme\uc774 \uacc4\uc18d \uc5c5\ub370\uc774\ud2b8\ub418\uace0 \uc788\uc5b4\uc11c \uadf8\ub7f0\uc9c0 \uc774\uc804\ubcf4\ub2e4\ub294 \uc815\ubcf4\ub97c \uc5bb\uae30 \uc27d\uac8c \ubb38\uc11c\ud654\uac00 \ub418\uc5b4 \uc788\ub2e4. \uadf8\ub807\uae30\uc5d0 \ub354 \ucc38\uace0\ud558\uace0 \uc2f6\uc740 \ub0b4\uc6a9\uc774 \uc788\uc73c\uba74 \uacf5\uc2dd\ubb38\uc11c\ub97c \ucc38\uace0\ud558\uae30\ub97c \ubc14\ub780\ub2e4.\\n\\n## \ud604\uc7ac \ud3f0\ud2b8\\n\\n\uc9c0\uae08\uc740 **\uc28c** \ub4f1\uc758 \uba87\uba87 \ub2e8\uc5b4\uac00 \ub098\ub214\uc2a4\ud018\uc5b4\uc5d0\uc11c \uc801\uc6a9\ub418\uc9c0 \uc54a\ub294 \uc0ac\uc2e4\uc744 \uc54c\uac8c \ub418\uc5b4 Spoqa Han Sans Neo(\uc2a4\ud3ec\uce74 \ud55c \uc0b0\uc2a4 \ub124\uc624) \ud3f0\ud2b8\ub85c \ubcc0\uacbd\ud588\ub2e4.\\n\\n## References\\n\\n>- [\ub124\uc774\ubc84 \uae00\uaf34 \ubaa8\uc74c](https://hangeul.naver.com/font)\\n>- [\uc2a4\ud3ec\uce74 \ud55c \uc0b0\uc2a4 \ub124\uc624](https://spoqa.github.io/spoqa-han-sans/)\\n>- [PaperMod FAQs](https://adityatelange.github.io/hugo-PaperMod/posts/papermod/papermod-faq/)"},{"id":"/django-port-is-already-in-use","metadata":{"permalink":"/blog/django-port-is-already-in-use","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/2022-03-07-django-port-is-already-in-use/django-port-is-already-in-use.md","source":"@site/blog/2022-03-07-django-port-is-already-in-use/django-port-is-already-in-use.md","title":"\ud504\ub85c\uc138\uc2a4 \uac15\uc81c \uc885\ub8cc\ud558\uae30","description":"\uc2e4\uc218 \ub54c\ubb38\uc5d0 \uc0dd\uae34 \ubb38\uc81c \ud574\uacb0","date":"2022-03-07T00:00:00.000Z","formattedDate":"2022\ub144 3\uc6d4 7\uc77c","tags":[{"label":"Problem Solving","permalink":"/blog/tags/problem-solving"}],"hasTruncateMarker":true,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\uace0 \uc788\ub294 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"\ud504\ub85c\uc138\uc2a4 \uac15\uc81c \uc885\ub8cc\ud558\uae30","date":"2022-03-07","authors":"teddygood","tags":["Problem Solving"],"draft":false,"slug":"/django-port-is-already-in-use","description":"\uc2e4\uc218 \ub54c\ubb38\uc5d0 \uc0dd\uae34 \ubb38\uc81c \ud574\uacb0","keywords":["Django","port","\ud504\ub85c\uc138\uc2a4 \uac15\uc81c \uc885\ub8cc","\uae54\ub054\ud55c \ud30c\uc774\uc36c \ud0c4\ud0c4\ud55c \ubc31\uc5d4\ub4dc"]},"prevItem":{"title":"Hugo PaperMod theme \ud3f0\ud2b8 \ubcc0\uacbd\ud558\uae30","permalink":"/blog/change-font-in-papermod"},"nextItem":{"title":"\ubc15\ubbf8\uc815\uc758 \uae43&\uae43\ud5c8\ube0c \uc785\ubb38","permalink":"/blog/Git-GitHub-introduction"}},"content":"## \uc2e4\uc218 \ub54c\ubb38\uc5d0 \uc0dd\uae34 \uc5d0\ub7ec\\n\\ndjango\ub97c \uc2dc\uc791\ud558\uace0 \uc885\ub8cc\ud560 \ub54c `Ctrl-C`\ub97c \uc0ac\uc6a9\ud574\uc11c \uaebc\uc57c \ud588\ub294\ub370 `Ctrl-Z`\ub97c \uc0ac\uc6a9\ud588\ub2e4.\\n\uc885\ub8cc\uac00 \uc81c\ub300\ub85c \ub41c \uc904 \uc54c\uc558\uc9c0\ub9cc, \ud504\ub85c\uc138\uc2a4\uac00 \uc911\ub2e8\ub41c \uac83\uc774\uc5c8\ub2e4.\\n\\n![port-error-image](port-error-message.jpg)  \\n\\n\uacb0\uad6d \uc704\uc758 `Error: That port is already in use.`\ub77c\ub294 \uc5d0\ub7ec\uac00 \ubc1c\uc0dd\ud588\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n## \ud574\uacb0\\n\\n![ps](python-ps.jpg)  \\n\\n\ub300\ucda9 \ud504\ub85c\uc138\uc2a4\ub97c \uc885\ub8cc\ud558\uba74 \ub418\uc9c0 \uc54a\uc744\uae4c \uc0dd\uac01\ud588\uace0, `ps` \uba85\ub839\uc5b4\ub97c \uc0ac\uc6a9\ud574\ubd24\uc73c\ub098 \uc5ed\uc2dc \uc5b4\ub5a4 PID\uac00 \uc7a5\uace0 \ud504\ub85c\uc138\uc2a4\uc778\uc9c0 \uc54c\uc544\ubcfc \uc218 \uc5c6\uc5c8\ub2e4.\\n\\n\uacb0\uad6d \uc2a4\ud0dd\uc624\ubc84\ud50c\ub85c\uc6b0\uc5d0 \ub0c5\ub2e4 \uac80\uc0c9\ud574\ubc84\ub838\ub2e4.(Reference \ucc38\uace0)  \\n\uc5ed\uc2dc StackOverFlow\ub294 \uc815\ub2f5\uc744 \uc54c\ub824\uc92c\ub2e4.(\uc2a4\ud0dd\uc624\ubc84\ud50c\ub85c\uc6b0\ub294 \uc2e0\uc774\uc57c!)\\n\\n```bash\\nsudo lsof -t -i tcp:8000 | xargs kill -9\\n```\\n\\n\uc704\uc758 \uba85\ub839\uc5b4\ub97c \uc0ac\uc6a9\ud558\uba74 \ud574\uacb0\uc774 \ub41c\ub2e4.\\n\\n\uac04\ub2e8\ud558\uac8c \uc815\ub9ac\ud558\uc790\uba74 `lsof`\ub294 \uc2dc\uc2a4\ud15c\uc5d0 \uc5f4\ub824\uc788\ub294 \ud30c\uc77c\uc5d0 \ub300\ud55c \uc815\ubcf4\ub97c \ucd9c\ub825\ud558\ub294 \uba85\ub839\uc5b4\ub2e4.\\n\uc5ec\uae30\uc11c \uc0ac\uc6a9\ud55c `-i` \uc635\uc158\uc740 \uc5f4\ub824\uc788\ub294 \ub124\ud2b8\uc6cc\ud06c \ud3ec\ud2b8 \uc815\ubcf4\ub97c \ud655\uc778\ud558\ub294 \uac83\uc774\uace0, `-t` \uc635\uc158\uc740 \uadf8 \uc911 PID\ub9cc \ucd9c\ub825\ud55c\ub2e4\ub294 \uac83\uc774\ub2e4.\\n\\n`xargs`\ub294 \ud30c\uc774\ud504 \uc774\uc804\uc758 \uba85\ub839\uc744 \uc778\uc790\ub85c \ubc1b\uc544 \ub2e4\uc74c \uba85\ub839\uc744 \uc2e4\ud589\ud560 \ub54c \uc8fc\ub85c \uc0ac\uc6a9\ud55c\ub2e4.  \\n\\n`kill -9`\ub294 \uc720\uba85\ud574\uc11c \ub2e4\ub4e4 \uc544\uc2dc\uaca0\uc9c0\ub9cc SIGNAL \ub9ac\uc2a4\ud2b8 \uc911 `SIGKILL`\uc758 \ubc88\ud638\ub97c \uc635\uc158\uc73c\ub85c \uc0ac\uc6a9\ud55c \uac83\uc774\ub2e4.\\n\\n\uba85\ub839\uc5b4\ub294 \uc6b0\ubd84\ud22c \ud658\uacbd\uc5d0\uc11c \uc0ac\uc6a9\ud588\uc9c0\ub9cc, \ub9e5\uc5d0\uc11c\ub3c4 \ub3cc\uc544\uac04\ub2e4\uace0 \ud55c\ub2e4.\\n\\n## References\\n\\n>- [jango Server Error: port is already in use - stackoverflow](https://stackoverflow.com/questions/20239232/django-server-error-port-is-already-in-use) \\n>- [Ubuntu \ud504\ub85c\uc138\uc2a4 \uac15\uc81c \uc885\ub8cc\uc2dc\ud0a4\uae30](https://ghostweb.tistory.com/828)\\n>- [lsof \uba85\ub839\uc5b4 \uc0ac\uc6a9\ubc95](https://dev.plusblog.co.kr/44)\\n>- [xargs \uba85\ub839 & \ud30c\uc774\ud504 \uc640 \ucc28\uc774\uc810 \uc644\ubcbd \uc815\ub9ac (\ud45c\uc900\uc785\ub825 / \uc778\uc790 \ucc28\uc774)](https://inpa.tistory.com/entry/LINUX-%F0%9F%93%9A-xargs-%EB%AA%85%EB%A0%B9-%ED%8C%8C%EC%9D%B4%ED%94%84-%EC%99%80-%EC%B0%A8%EC%9D%B4%EC%A0%90-%EC%99%84%EB%B2%BD-%EC%A0%95%EB%A6%AC-%ED%91%9C%EC%A4%80%EC%9E%85%EB%A0%A5-%EC%9D%B8%EC%9E%90-%EC%B0%A8%EC%9D%B4#top)"},{"id":"/Git-GitHub-introduction","metadata":{"permalink":"/blog/Git-GitHub-introduction","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/2021-10-08-Git-GitHub-introduction/Git-GitHub-introduction.md","source":"@site/blog/2021-10-08-Git-GitHub-introduction/Git-GitHub-introduction.md","title":"\ubc15\ubbf8\uc815\uc758 \uae43&\uae43\ud5c8\ube0c \uc785\ubb38","description":"Must Have | \ud504\ub85c\uc81d\ud2b8 \ud611\uc5c5 \uc2dc\ub098\ub9ac\uc624\ub85c \uc775\ud788\ub294 Git&GitHub \ubc18\ubcf5 \ud559\uc2b5\uc11c","date":"2021-10-08T00:00:00.000Z","formattedDate":"2021\ub144 10\uc6d4 8\uc77c","tags":[{"label":"Book Review","permalink":"/blog/tags/book-review"}],"hasTruncateMarker":true,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\uace0 \uc788\ub294 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"\ubc15\ubbf8\uc815\uc758 \uae43&\uae43\ud5c8\ube0c \uc785\ubb38","date":"2021-10-08","authors":"teddygood","tags":["Book Review"],"draft":false,"slug":"/Git-GitHub-introduction","description":"Must Have | \ud504\ub85c\uc81d\ud2b8 \ud611\uc5c5 \uc2dc\ub098\ub9ac\uc624\ub85c \uc775\ud788\ub294 Git&GitHub \ubc18\ubcf5 \ud559\uc2b5\uc11c","keywords":["Git","GitHub","\uae43","\uae43\ud5c8\ube0c"]},"prevItem":{"title":"\ud504\ub85c\uc138\uc2a4 \uac15\uc81c \uc885\ub8cc\ud558\uae30","permalink":"/blog/django-port-is-already-in-use"},"nextItem":{"title":"\uae54\ub054\ud55c \ud30c\uc774\uc36c \ud0c4\ud0c4\ud55c \ubc31\uc5d4\ub4dc","permalink":"/blog/python-backend-flask"}},"content":":::info\\n\uace8\ub4e0\ub798\ube57 \ucd9c\ud310\uc0ac\ub85c\ubd80\ud130 \ucc45\uc744 \uc81c\uacf5\ubc1b\uc544 \uc791\uc131\ud588\uc2b5\ub2c8\ub2e4.\\n:::\\n\\n## Book Info\\n\\n:::tip\\n\ucc45 \uc774\ubbf8\uc9c0\ub97c \ud074\ub9ad\ud558\uba74 \uad50\ubcf4\ubb38\uace0 \uc0ac\uc774\ud2b8\ub85c \uc774\ub3d9\ud569\ub2c8\ub2e4!\\n:::\\n\\n[![\ucc45](../assets/review/Git-GitHub-introduction.jpg)](http://www.kyobobook.co.kr/product/detailViewKor.laf?ejkGb=KOR&mallGb=KOR&barcode=9791191905014&orderClick=LEa&Kc=)\\n\\n- \uc81c\ubaa9: \ubc15\ubbf8\uc815\uc758 \uae43&\uae43\ud5c8\ube0c \uc785\ubb38\\n- \uc800\uc790: \ubc15\ubbf8\uc815\\n- \ucd9c\ud310\uc0ac: \uace8\ub4e0\ub798\ube57\\n- \ucd9c\uac04: 2021-09-13\\n\\n\x3c!--truncate--\x3e\\n\\n## Intro\\n\\n\uc800\uc790\uaed8\uc11c\ub294 [\uc5bc\ub610(Early \ub610\ub77c\uc774)](https://www.facebook.com/groups/earlyddorai/about) \uadf8\ub8f9\uc744 \uc6b4\uc601\ud558\uc2dc\uba70, \ubc30\ubbfc \ubca0\ud2b8\ub0a8\uc744 \uac70\uccd0 \ud604\uc7ac \ubb34\uc2e0\uc0ac\uc5d0 \uacc4\uc2e0 \ubc15\ubbf8\uc815 \ub2d8\uc774\uc2ed\ub2c8\ub2e4. \uc774 \ucc45\uc774 \ucd9c\uac04\ub418\uae30 \uc804 \ubca0\ud0c0\ub9ac\ub354\ub97c \ubaa8\uc9d1\ud588\uc744 \ub54c, \uac1c\uc778\uc801\uc778 \ud32c\uc2ec\uc73c\ub85c \ucc45\uc744 \uc77d\uc5b4\ubcf4\uace0 \uc2f6\uc5b4 \uc2e0\uccad\ud588\uc73c\ub098 \ub5a8\uc5b4\uc84c\uc5c8\uc2b5\ub2c8\ub2e4. \uadf8\ub7ec\ub098 \ucc45\uc774 \ucd9c\uac04\ub41c \uc774\ud6c4, \uace8\ub4e0\ub798\ube57 \ucd9c\ud310\uc0ac\uc5d0\uc11c \ubd81\uc2a4\ud3ec\uc77c\ub7ec\ub97c \ubaa8\uc9d1\ud588\uace0, \ub3c4\uc804\ud558\uc5ec \uc774 \ucc45\uc744 \uc77d\uc744 \uc218 \uc788\uac8c \ub410\uc2b5\ub2c8\ub2e4.\\n\\n\ubd81\uc2a4\ud3ec\uc77c\ub7ec\uc5d0 \ub3c4\uc804\ud560 \ub54c\ub294 **\\"\ud32c\uc2ec\ub9cc\uc774 \uc544\ub2c8\ub77c \ub098\uc5d0\uac8c Git \uc9c0\uc2dd\uc774 \ub354 \ud544\uc694\ud560\uae4c?\\"** \uc5d0 \ub300\ud55c \uace0\ubbfc\uc744 \uc7a0\uc2dc \ud588\uc2b5\ub2c8\ub2e4. commit\ud558\uace0 push\ud558\ub294 \uac74 \uc775\uc219\ud558\ub2c8\uae4c\uc694. \uadf8\ub7ec\ub098 GitHub\uc73c\ub85c \ud611\uc5c5\uae4c\uc9c0 \uace0\ub824\ud560 \ub54c, \ube0c\ub79c\uce58 \ubcc0\uacbd, \uba38\uc9c0, \ud480 \ub9ac\ud018\uc2a4\ud2b8 \ub4f1\uc744 \uc0ac\uc6a9\ud558\ub294 \uac8c \uc544\uc9c1 \uc5b4\uc0c9\ud558\ub2e4\ub294 \uc0dd\uac01\uc774 \ub4e4\uc5b4 \uc2e0\uccad\ud558\uac8c \ub410\uc2b5\ub2c8\ub2e4.\\n\\n## Book Review\\n\\n### \uc2dc\ub098\ub9ac\uc624\\n\\n\uc774 \ucc45\uc5d0\ub294 **\uc2dc\ub098\ub9ac\uc624** \ub77c\uace0 \ub2e4\ub978 \ucc45\uacfc \uad6c\ubcc4\ub418\ub294 \uc7ac\ubc0c\ub294 \ubd80\ubd84\uc774 \uc788\uc2b5\ub2c8\ub2e4. \uc774\uc804\uc5d0 \ubc30\uc6b4 \ub0b4\uc6a9\uc744 \ud604\uc5c5\uc5d0\uc11c \uc77c\uc5b4\ub0a0 \ubc95\ud55c \uc2dc\ub098\ub9ac\uc624\uc5d0 \ub300\uc785\ud558\uc5ec \ud604\uc5c5\uc5d0\uc11c \uc9c4\ud589\ub418\ub294 \ud504\ub85c\uc81d\ud2b8 \ud504\ub85c\uc138\uc2a4\ub97c \uadf8\ub300\ub85c \uacbd\ud5d8\ud574\ubcfc \uc218 \uc788\ub294 \ubd80\ubd84\uc785\ub2c8\ub2e4. \uba87 \ubc88\uc758 \ud480 \ub9ac\ud018\uc2a4\ud2b8\ub97c \ud574\ubd24\uc9c0\ub9cc **\\"\uc2e4\uc81c \ud604\uc5c5\uc5d0\uc11c\ub294 \uc5b4\ub5a4 \uacfc\uc815\uc73c\ub85c \uc774\ub8e8\uc5b4\uc9c8\uae4c?\\"** \ub77c\ub294 \uace0\ubbfc\uc744 \ud588\ub358 \uc801\uc774 \uc788\uc2b5\ub2c8\ub2e4. \ub300\ub7b5 \uc5b4\ub5a4 \uacfc\uc815\uc73c\ub85c \uc774\ub8e8\uc5b4\uc9c0\ub294\uc9c0 \uc608\uc0c1\ub9cc \ud588\uc5c8\uc9c0\ub9cc, \uc774 \ucc45\uc744 \ud1b5\ud574\uc11c \ud504\ub85c\uc138\uc2a4\ub97c \uc9c1\uc811 \uacbd\ud5d8\ud574\ubcfc \uc218 \uc788\uc5b4\uc11c \uc0c1\ub2f9\ud788 \ub3c4\uc6c0\uc774 \ub410\uc2b5\ub2c8\ub2e4. \\n\\n### \ubc30\ud3ec \ubc0f \uc790\ub3d9\ud654 \\n\\n\ub2e4\ub978 \ucc45 \ub610\ub294 \uac15\uc758\uc5d0\uc11c\ub294 Git, GitHub \uc2e4\uc2b5\uc744 HTML, CSS, JavaScript \uac19\uc740 \uac04\ub2e8\ud55c \uc5b8\uc5b4\ub4e4\ub85c \uc9c4\ud589\ud588\uc744 \ud150\ub370 \uc774 \ucc45\uc5d0\uc11c\ub294 Node.js \uae30\ubc18\uc73c\ub85c \uc9c4\ud589\ud569\ub2c8\ub2e4. \uadf8 \uc774\uc720\ub294 GitHub Action\uc744 \uc774\uc6a9\ud574\ubcf4\uae30 \uc704\ud568\uc774\ub77c \uc0dd\uac01\ud569\ub2c8\ub2e4. \uc774 \ub3c4\uad6c\ub97c \uc0ac\uc6a9\ud558\uc5ec \uc790\ub3d9\ud654\ud558\uace0 \ubc30\ud3ec\ud558\ub294 \ub0b4\uc6a9\uc774 \uc778\uc0c1\uc801\uc774\uc5c8\uc2b5\ub2c8\ub2e4. GitHub Action\uae4c\uc9c0 \uc54c\ub824 \uc8fc\ub294 \ucc45\uc740 \uba87 \uc5c6\ub2e4\uace0 \uc0dd\uac01\ud558\uae30\uc5d0 GitHub Action\uc744 \uacbd\ud5d8\ud574\ubcf4\uace0 \uc2f6\uc740 \ubd84\uc774\ub77c\uba74 \uc774 \ucc45\uc744 \uc77d\ub294 \uac83\uc774 \ub3c4\uc6c0\uc774 \ub420 \uac83\uc774\ub77c\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4.\\n\\n### VSCode\\n\\n\uc608\uc804\uc5d0 \uc804 \uae43 \uba85\ub839\uc5b4\ub97c \uc9c1\uc811 \uc785\ub825\ud558\uace0 \uc2e4\ud589\ud558\ub294 \uac83\uc774 \ub108\ubb34 \ubc88\uac70\ub86d\ub2e4\uace0 \uc5ec\uaca8 \uc880 \ub354 \ud3b8\ud55c \ubc29\ubc95\uc744 \ucc3e\uc558\uc5c8\uc2b5\ub2c8\ub2e4. \uadf8 \ubc29\ubc95\uc774 \ubc14\ub85c VSCode\uc5d0\uc11c \uae43\uc744 \uc0ac\uc6a9\ud558\ub294 \uac83\uc785\ub2c8\ub2e4. \uc774 \ucc45\uc740 \uae43 \uba85\ub839\uc5b4\ub97c \uc9c1\uc811 \uc2e4\ud589\ud558\uace0 \ubc18\ubcf5\ud558\uba70 \uae43\uc5d0 \uc775\uc219\ud574\uc9c0\ub294 \uac83\uc5d0 \ucd08\uc810\uc744 \ub9de\ucd94\uace0 \uc788\uc9c0\ub9cc, \uba85\ub839\uc5b4\uc5d0 \ub108\ubb34 \uc775\uc219\ud55c \ubd84\ub4e4\uc774\ub77c\uba74 VSCode\ub97c \uc0ac\uc6a9\ud574\ubcf4\ub294 \uac83\ub3c4 \ud3b8\ub9ac\ud55c \ubc29\ubc95\uc774 \ub420 \uc218 \uc788\uc744 \uac83\uc785\ub2c8\ub2e4. \uc774 \ucc45\uc5d0\uc11c\ub294 \ubd80\ub85d\uc73c\ub85c VSCode\ub97c \uc0ac\uc6a9\ud574\ubcf4\ub294 \ubc29\ubc95\uc744 \uc54c\ub824\uc90d\ub2c8\ub2e4.\\n\\n### \uc704\ucca8\uc790 \uc6d0\uc5b4 \uc124\uba85\\n\\n\uc804 \uc704\ucca8\uc790\ub85c \uc804\ubb38 \uc6a9\uc5b4\ub97c \uc6d0\ubb38(\uc601\uc5b4) \uadf8\ub300\ub85c \uc801\uc5b4\ub0b4\ub294 \ubaa8\uc2b5\ub4e4\uc774 \uc88b\uc558\uc2b5\ub2c8\ub2e4. \uc774\ub7f0 \ubd80\ubd84\uc740 \ubcf4\ud1b5 \ubcc0\uc5ed\uc11c\uc5d0\uc11c \ucd9c\ud310\uc0ac \ub610\ub294 \uc5ed\uc790\uaed8\uc11c \ub3c5\uc790\ub4e4\uc774 \uc77d\uae30 \ub354 \ud3b8\ud558\ub3c4\ub85d \ud45c\uae30\ud558\ub294 \ubd80\ubd84\uc774\ub77c\uace0 \uc54c\uace0 \uc788\uc2b5\ub2c8\ub2e4. \ud55c\uad6d \ub3c4\uc11c\uc5d0\uc11c\ub294 \ud754\ud558\uc9c0 \uc54a\uc740 \ubd80\ubd84\uc774\uae30\uc5d0 \uc774 \ucc45\uc774 \uc815\ub9d0 **\\"\uc12c\uc138\ud558\ub2e4\\"** \ub77c\ub294 \ub290\ub08c\uc744 \ubc1b\uc558\uc2b5\ub2c8\ub2e4. \uac00\ub054 \uc77c\ubd80 \ubc88\uc5ed\uc11c\uc5d0\uc11c\ub294 \uc6a9\uc5b4\ub4e4\uc744 \uc804\ubd80 \ubc88\uc5ed\ub418\uace0 \uc601\ubb38\uc73c\ub85c \ud45c\uae30\uac00 \uc548 \ub418\uc5b4 \uc788\ub294 \ubd80\ubd84\ub4e4\uc774 \uc788\ub294\ub370 \uadf8\ub7f4 \ub54c\ub9c8\ub2e4 \ubd88\ud3b8\ud568\uc744 \ub290\ub08d\ub2c8\ub2e4. \uadf8\uc5d0 \ube44\ud574 \uad6d\ub0b4 \ub3c4\uc11c\uc778 \uc774 \ucc45\uc740 \ub3c5\uc790\ub97c \uc2e0\uacbd \uc4f0\ub294 \ub4ef\ud55c \ub290\ub08c\uc744 \uc8fc\uc5c8\uace0, \ub9e4\uc6b0 \uce5c\uc808\ud558\ub2e4\uace0 \ub290\uaef4\uc84c\uc2b5\ub2c8\ub2e4.\\n\\n\uc194\uc9c1\ud788 \uc81c\uac00 \uc77d\uc740 \uba87\uba87 \ubc88\uc5ed\uc11c\uc5d0\uc11c\ub294 \uc601\uc5b4 \uc6d0\ubb38 \uadf8\ub300\ub85c\ub97c \uc54c\uace0 \uc2f6\uc740\ub370 \ucc98\uc74c \ub4e4\uc5b4\ubcf8 \uc6a9\uc5b4\ub4e4\ub85c \ubc88\uc5ed\ub41c \uacbd\uc6b0\ub4e4\uc774 \uaf64 \uc788\uc5c8\uc2b5\ub2c8\ub2e4. \uc774\ub7f0 \uacbd\uc6b0\uc5d0\ub294 \uaf2d \uad6c\uae00\ub9c1\uc744 \ud574\ubcf4\uba74\uc11c \uadf8 \uc6a9\uc5b4\ub97c \ucc3e\uc558\uc5b4\uc57c \ud588\uc8e0. \ucc45\uc744 \uc77d\ub294 \uc0ac\ub78c\uc5d0\uc11c\ub294 \ubd88\ud3b8\ud55c \ubd80\ubd84\uc785\ub2c8\ub2e4. \ucc45\uc740 \uc790\uc2e0\uc774 \ubc30\uc6b0\uace0 \uc2f6\uc740 \ub0b4\uc6a9\uc744 \uc815\ub9ac\ud574\uc11c \ubcf4\uace0 \uc2f6\uc740 \uac83\uc778\ub370 \uadf8\uac78 \ub2e4\uc2dc \ucc3e\uc544\ubd10\uc57c \ud55c\ub2e4\ub2c8, \uadf8\uac83\ub9cc\ud07c \ubd88\ud3b8\ud55c \uac83\uc740 \uc5c6\uaca0\uc8e0. \ubb3c\ub860 \ucd5c\uadfc\uc5d0 \ub098\uc628 \ubc88\uc5ed\uc11c\ub4e4\uc740 \uc12c\uc138\ud574\uc11c \uc774\ub7f0 \ucc45\ub4e4\uc740 \ud754\ud558\uc9c0 \uc54a\uc744 \uac83\uc774\ub77c \uc0dd\uac01\ud569\ub2c8\ub2e4. \\n\\n\\n## \ub300\uc0c1\ub3c5\uc790\\n\\n\uc804 [Pro Git](https://git-scm.com/book/ko/v2)\uc73c\ub85c Git\uc744 \uacf5\ubd80\ud55c \uc0ac\ub78c\uc785\ub2c8\ub2e4. GitHub\ub294 \ub530\ub85c \uc778\ud130\ub137\uc5d0\uc11c \ubb38\uc11c\ub4e4\uc744 \ub9c9 \ucc3e\uc544\uac00\uba74\uc11c \uacf5\ubd80\ud588\uc5c8\uace0\uc694. \uc608\uc804\uc5d0 \uadf8 \ucc45\uc73c\ub85c Git\uc744 \uacf5\ubd80\ud558\uba74\uc11c \ub450 \ubc88 \uc815\ub3c4\ub294 \ud3ec\uae30\ud588\ub358 \uacbd\ud5d8\uc774 \uc788\uc2b5\ub2c8\ub2e4. tracked, staged \ub4f1 \uad00\uacc4\ub97c \uc774\ud574\ud558\ub294 \ub370 \uba38\ub9ac\uac00 \uc544\ud320\uac70\ub4e0\uc694. \uc774 \ucc45\uc740 \uadf8\ub7f0 \uac71\uc815 \ud544\uc694 \uc5c6\uc774 \uae54\ub054\ud558\uac8c \uc815\ub9ac\ub418\uc5b4 \uc788\uc2b5\ub2c8\ub2e4. \ub610\ud55c, \ub3c5\uc790\ub97c \ubc30\ub824\ud558\ub294 \uc138\uc138\ud55c \ubd80\ubd84\ub4e4\uc774 \ub9ce\uc2b5\ub2c8\ub2e4. \ub2f9\uc7a5 \ud3b8\uc9d1\uc790\uc774\uc2e0 [\ucd5c\ud604\uc6b0 \ud3b8\uc9d1\uc790\ub2d8\uc758 \ud3b8\uc9d1 \ud6c4\uae30](https://brunch.co.kr/@hwchoi/32)\ub9cc \ubcf4\uc154\ub3c4 \uc54c \uc218 \uc788\uc744 \uac83\uc785\ub2c8\ub2e4. \uc81c\uac00 \ub9ac\ubdf0\ub97c \ud558\uba74\uc11c \uc801\uc5b4\ub454 \ubd80\ubd84 \uc774\uc678\uc5d0\ub3c4 \ub3c5\uc790\ub97c \uc0dd\uac01\ud558\uc2dc\ub294 \ubd80\ubd84\ub4e4\uc774 \ub354 \ub9ce\uc2b5\ub2c8\ub2e4. \uc815\ub9d0 \ub3c5\uc790\ub97c \uc704\ud558\uace0 \uae54\ub054\ud558\uac8c \uc815\ub9ac\ub41c \uc788\ub294 \ucc45\uc744 \ubcf4\uace0 \uc2f6\uc73c\uc2dc\ub2e4\uba74 \uc774 \ucc45\uc744 \ucd94\ucc9c\ud574 \ub4dc\ub9bd\ub2c8\ub2e4.\\n\\n\ucd5c\uadfc Git\uacfc GitHub\ub294 \uac1c\ubc1c\uc790\ub77c\uba74 \uac70\uc758 \ub204\uad6c\ub4e0\uc9c0 \uc54c\uc544\uc57c \ud558\ub294 \ud544\uc218 \uc9c0\uc2dd\uc774 \ub418\uc5b4\ubc84\ub838\uc2b5\ub2c8\ub2e4. \uae30\uc220\uc774 \ub610 \uc5b4\ub5bb\uac8c \ubc14\ub014\uc9c0\ub294 \uc798 \ubaa8\ub974\uaca0\uc9c0\ub9cc, GitHub\ub294 \uac1c\ubc1c\uc790\ub4e4\uc758 SNS \uac19\uc740 \ub290\ub08c\uc774\ub77c \uac1c\ubc1c\uc790\uc5d0\uac8c \uc720\uc6a9\ud55c \uc815\ubcf4\ub4e4\uc774 \ub9ce\uc774 \uc62c\ub77c\uc640 \uc788\uc2b5\ub2c8\ub2e4. Git\uacfc GitHub\ub294 \uc815\ub9d0 \uac1c\ubc1c\uc5d0 \uad00\uc2ec\uc774 \uc788\uc73c\uc2dc\ub2e4\uba74 \uc77c\ucc0d \ubc30\uc6b0\uba74 \ubc30\uc6b8\uc218\ub85d \ub3c4\uc6c0\uc774 \ub420 \uac83\uc785\ub2c8\ub2e4.\\n\\n\uc774 \ucc45\uc758 \uac00\uc7a5 \ud070 \uc7a5\uc810\uc740 \uc785\ubb38\uc11c\uc774\uba74\uc11c \ud604\uc5c5 \ud504\ub85c\uc138\uc2a4\ub97c \uacbd\ud5d8\ud574\ubcfc \uc218 \uc788\ub2e4\ub294 \uc810\uc785\ub2c8\ub2e4. \uae43\ub3c4 \uc2ec\ud654\uc801\uc778 \ubd80\ubd84\uc73c\ub85c \ub4e4\uc5b4\uac00\uba74 [submodule](https://git-scm.com/book/ko/v2/Git-%EB%8F%84%EA%B5%AC-%EC%84%9C%EB%B8%8C%EB%AA%A8%EB%93%88) \ub4f1\uc758 \ub0b4\uc6a9\uc774 \uc788\uc9c0\ub9cc \uadf8\ub7f0 \ub0b4\uc6a9\uc740 \uc81c\uc678\ud558\uace0 \uc815\ub9d0 \ud604\uc5c5\uc5d0\uc11c \uc790\uc8fc \uc4f0\uc774\ub294 \ub0b4\uc6a9\ub9cc \ub2f4\uaca8 \uc788\uc2b5\ub2c8\ub2e4. \uadf8\ub807\uae30\uc5d0 \uc804 \uc774 \ucc45\uc744 Git\uacfc GitHub\uc5d0 \uc775\uc219\ud558\uc9c0 \uc54a\uc740 \uc785\ubb38\uc790\uc5d0\uac8c \ucd94\ucc9c\ud558\uace0 \uc2f6\uc2b5\ub2c8\ub2e4."},{"id":"/python-backend-flask","metadata":{"permalink":"/blog/python-backend-flask","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/2021-08-23-python-backend-flask/python-backend-flask.md","source":"@site/blog/2021-08-23-python-backend-flask/python-backend-flask.md","title":"\uae54\ub054\ud55c \ud30c\uc774\uc36c \ud0c4\ud0c4\ud55c \ubc31\uc5d4\ub4dc","description":"\uc9c0\uae08\uae4c\uc9c0 \uc5c6\uc5c8\ub358 \ubc31\uc5d4\ub4dc \uac1c\ubc1c\uc790\ub97c \uc704\ud55c \ud30c\uc774\uc36c","date":"2021-08-23T00:00:00.000Z","formattedDate":"2021\ub144 8\uc6d4 23\uc77c","tags":[{"label":"Book Review","permalink":"/blog/tags/book-review"}],"hasTruncateMarker":true,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\uace0 \uc788\ub294 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"\uae54\ub054\ud55c \ud30c\uc774\uc36c \ud0c4\ud0c4\ud55c \ubc31\uc5d4\ub4dc","date":"2021-08-23","authors":"teddygood","tags":["Book Review"],"draft":false,"slug":"/python-backend-flask","description":"\uc9c0\uae08\uae4c\uc9c0 \uc5c6\uc5c8\ub358 \ubc31\uc5d4\ub4dc \uac1c\ubc1c\uc790\ub97c \uc704\ud55c \ud30c\uc774\uc36c","keywords":["Backend","Flask","Python","API"]},"prevItem":{"title":"\ubc15\ubbf8\uc815\uc758 \uae43&\uae43\ud5c8\ube0c \uc785\ubb38","permalink":"/blog/Git-GitHub-introduction"},"nextItem":{"title":"PyJWT \ub808\uac70\uc2dc \ucf54\ub4dc \uc218\uc815","permalink":"/blog/AttributeError-str-decode"}},"content":"## Book Info\\n\\n:::tip\\n\ucc45 \uc774\ubbf8\uc9c0\ub97c \ud074\ub9ad\ud558\uba74 \uad50\ubcf4\ubb38\uace0 \uc0ac\uc774\ud2b8\ub85c \uc774\ub3d9\ud569\ub2c8\ub2e4!\\n:::\\n\\n[![\ucc45](../assets/review/python-backend.jpg)](http://www.kyobobook.co.kr/product/detailViewKor.laf?ejkGb=KOR&mallGb=KOR&barcode=9791186697757&orderClick=LEa&Kc=)\\n\\n- \uc81c\ubaa9: \uae54\ub054\ud55c \ud30c\uc774\uc36c \ud0c4\ud0c4\ud55c \ubc31\uc5d4\ub4dc\\n- \uc800\uc790: \uc1a1\uc740\uc6b0\\n- \ucd9c\ud310\uc0ac: \ube44\uc81c\uc774\ud37c\ube14\ub9ad\\n- \ucd9c\uac04: 2019-01-25\\n\\n\x3c!--truncate--\x3e\\n\\n## Intro\\n\\n\uc774 \ucc45\uc740 flask\ub85c API\ub97c \uc81c\uc791\ud574\ubcfc \uc218 \uc788\ub3c4\ub85d \ub3c4\uc640\uc8fc\ub294 \ucc45\uc785\ub2c8\ub2e4. \uc0ac\uc2e4 flask \ucc45\uc740 \ucd5c\uadfc\uc5d0 [Do it! \uc810\ud504 \ud22c \ud50c\ub77c\uc2a4\ud06c](http://www.kyobobook.co.kr/product/detailViewKor.laf?ejkGb=KOR&mallGb=KOR&barcode=9791163031970&orderClick=LEa&Kc=)\ub77c\ub294 \uc88b\uc740 \ucc45\uc774 \ub098\uc654\uc8e0. \uadf8\ub7f0\ub370\ub3c4 \uc774 \ucc45\uc744 \uc120\ud0dd\ud55c \uc774\uc720\ub294 \ub2e8\uc21c\ud788 \ud50c\ub77c\uc2a4\ud06c\ub9cc \uacf5\ubd80\ud558\ub294 \uac83\uc774 \uc544\ub2c8\ub77c API \uac1c\ubc1c\uc744 \uacf5\ubd80\ud574\ubcf4\uace0 \uc2f6\uc5c8\uae30 \ub54c\ubb38\uc785\ub2c8\ub2e4. \ud2b9\ud788 \ubc31\uc5d4\ub4dc\uc5d0\uc11c \uac70\uc758 \ud544\uc218\uc801\uc73c\ub85c \uc0ac\uc6a9\ud558\ub294 REST \uc544\ud0a4\ud14d\ucc98 \ud328\ud134\uc744 \uc0ac\uc6a9\ud574\uc11c \ub9d0\uc774\uc8e0.\\n\\n\uc774 \ucc45\uc740 \ud50c\ub77c\uc2a4\ud06c, REST API\ub97c \uac19\uc774 \uacf5\ubd80\ud560 \uc218 \uc788\ub294 \ucc45 \uc911\uc5d0 \uadf8\ub098\ub9c8 \uac00\uc7a5 \ucd5c\uadfc\uc5d0 \ub098\uc654\uc2b5\ub2c8\ub2e4. \ub2e4\ub978 \ucc45\ub4e4\uc740 \ub354 \uc624\ub798\ub41c \ucc45\uc774\uac70\ub098, \ucc45 \ub9ac\ubdf0\uac00 \uc5c6\uc5b4\uc11c \ud070 \uace0\ubbfc \uc5c6\uc774 \uc774 \ucc45\uc744 \uad6c\ub9e4\ud588\uc5c8\uc2b5\ub2c8\ub2e4. \uc544\ubb34\ub798\ub3c4 \uc800\ud76c \ub098\ub77c\uc5d0\uc11c\ub294 \ud30c\uc774\uc36c\uc744 \ud65c\uc6a9\ud55c \ubc31\uc5d4\ub4dc\ubcf4\ub2e4 \uc790\ubc14 \uc2a4\ud504\ub9c1\uc744 \ub354 \ub9ce\uc774 \uc0ac\uc6a9\ud574\uc11c \uadf8\ub7f0\uc9c0 \ud30c\uc774\uc36c\uc744 \ud65c\uc6a9\ud55c \ubc31\uc5d4\ub4dc \ucc45\uc774 \uaf64 \uc801\uc740 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \ud30c\uc774\uc36c\uc744 \uc990\uaca8 \uc4f0\ub294 \uc0ac\ub78c\uc73c\ub85c\uc11c \ud30c\uc774\uc36c\uc744 \ud65c\uc6a9\ud55c \ubc31\uc5d4\ub4dc \ucc45\ub3c4 \ub9ce\uc774 \ub098\uc654\uc73c\uba74 \uc88b\uaca0\uc2b5\ub2c8\ub2e4.\\n\\n## Book Review\\n\\n### API \uc81c\uc791\\n\\ntwitter\uc758 \uc77c\ubd80 \ud575\uc2ec \uae30\ub2a5\ub4e4\uc744 \uad6c\ud604\ud574\uc11c \ubbf8\ub2c8 \ubc84\uc804\uc758 \ud2b8\uc704\ud130\ub97c \ub9cc\ub4e4\uc5b4\ubd05\ub2c8\ub2e4. \uc774 API\ub97c \ub9cc\ub4e4\uc5b4\ubcf4\uba74\uc11c HTTP, \ub370\uc774\ud130\ubca0\uc774\uc2a4, unit test, AWS \ubc30\ud3ec \ub4f1 \ubc31\uc5d4\ub4dc \uac1c\ubc1c\uc744 \uacbd\ud5d8\ud558\uace0 \uae30\ubcf8\uc801\uc778 \uac1c\ub150\ub4e4\uc744 \uacf5\ubd80\ud558\ub294 \ubc29\uc2dd\uc774\uc8e0. \uadf8\ub807\uae30\uc5d0 \uc804\ubc18\uc801\uc778 \ubc31\uc5d4\ub4dc \uacf5\ubd80\uc5d0\ub294 \ub3c4\uc6c0\uc774 \ub418\uc9c0\ub9cc, \ud50c\ub77c\uc2a4\ud06c \uae30\ub2a5\uc5d0 \ub300\ud55c \uacf5\ubd80\uc5d0\ub294 \ud06c\uac8c \ub3c4\uc6c0\uc774 \ub418\uc9c0\ub294 \uc54a\uc740 \uac83 \uac19\uc2b5\ub2c8\ub2e4.\\n\\nHTTP \uac1c\ub150\ub4e4\uc744 \ub2e4\uc2dc \ubcf5\uc2b5\ud574\ubcfc \uc218 \uc788\uc5c8\uace0 \uc778\uc99d \ubd80\ubd84\uc744 \ub2e4\ub8e8\ub294 \uac83\ub3c4 \uc7ac\ubc0c\uc5c8\uc2b5\ub2c8\ub2e4. \uc544\ud0a4\ud14d\ucc98\ub97c \ub2e4\ub8e8\ub294 \ubd80\ubd84\ub3c4 \uc788\uc5c8\ub294\ub370 \\"\uc774\ub7f0 \ubd80\ubd84\ub3c4 \ub2e4\ub904\uc900\ub2e4\uace0?\\" \uc0dd\uac01\uc774 \ub4e4 \uc815\ub3c4\ub85c \ub3c4\uc6c0\uc774 \ub410\ub358 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \\n\\n### \ud0a4\uc6cc\ub4dc \uc81c\uc2dc\\n\\n\uc804 \ucc45\ub4e4\uc744 \uc77d\uc744 \ub54c \ub05d\uc5d0 \ubd80\ub85d\uc5d0\uc11c\ub77c\ub3c4 \ub2e4\uc74c\uc5d0 \uacf5\ubd80\ud560 \uc8fc\uc81c\ub97c \uc81c\uc2dc\ud574\uc8fc\ub294 \uac83\uc744 \uc120\ud638\ud558\ub294 \ud3b8\uc785\ub2c8\ub2e4. \uac04\ub2e8\ud558\uac8c\ub77c\ub3c4 \uc5b4\ub5a4 \ud0a4\uc6cc\ub4dc\ub97c \uc81c\uc2dc\ud574\uc8fc\uba74 \uadf8\uc5d0 \ub300\ud574 \uad6c\uae00\ub9c1\uc744 \ud574\ubcf4\uba74\uc11c \ub610\ub294 \ub2e4\uc74c \uc8fc\uc81c\uc5d0 \ub300\ud55c \ucc45, \uac15\uc758\ub97c \ubcf4\uba74\uc11c \uacf5\ubd80\ub97c \ud560 \uc218 \uc788\uc73c\ub2c8\uae4c\uc694. \uadf8\ub7f0 \ubd80\ubd84\uc5d0\uc120 \uc800\ub294 \uc774 \ucc45\uc774 \uad1c\ucc2e\uc558\ub2e4\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4. \\n\\n### \ub808\uac70\uc2dc \ucf54\ub4dc\\n\\n\uc774 \ucc45\uc774 2019\ub144 \ucd08\ubc18\uc5d0 \ucd9c\uac04\ub418\uc5c8\uae30 \ub54c\ubb38\uc5d0 2021\ub144 \uc911\ubc18\uc5d0 \uc77d\ub294 \uc9c0\uae08 \uc5b4\ub290 \uc815\ub3c4\ub294 \uc608\uc0c1\ud588\ub358 \ubd80\ubd84\uc785\ub2c8\ub2e4. \\"\uc124\ub9c8 \ub9ce\uc774 \ub098\uc624\uaca0\uc5b4?\\"\ub77c\ub294 \uc0dd\uac01\uc744 \ud558\uba74\uc11c \uc774 \ucc45\uc744 \uc77d\uc5c8\uc2b5\ub2c8\ub2e4. \ub2e4\ud589\ud788 [decode \uc5d0\ub7ec](https://teddygood.github.io/python/AttributeError-str-decode/) \ub9d0\uace0\ub294 \ub531\ud788 \ucf54\ub4dc\ub97c \ub3cc\ub9ac\ub294 \ub370 \uc5b4\ub824\uc6c0\uc740 \uc5c6\uc5c8\ub358 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \\n\\n### \uc0dd\ub7b5\ub41c \ucf54\ub4dc\\n\\n\uc544\ubb34\ub798\ub3c4 \ucc45\uc774 \ub2e4\uc591\ud55c \uc8fc\uc81c\ub4e4\uc744 \ub2e4\ub8e8\ub2e4 \ubcf4\ub2c8 \uad6c\ud604\ud574\uc57c \ud558\ub294 \uc77c\ubd80 \ucf54\ub4dc\ub97c \uc0dd\ub7b5\ud569\ub2c8\ub2e4. \uc774 \ubd80\ubd84\uc740 \uc880 \uc544\uc26c\uc6e0\uc9c0\ub9cc \uc774\ub7f0 \ubd80\ubd84\uae4c\uc9c0 \uc0c1\uc138\ud558\uac8c \ub2e4\ub918\ub2e4\uba74 \uc544\ubb34\ub798\ub3c4 \ucc45\uc774 400\ucabd\uc774 \uc544\ub2c8\ub77c \ub300\ub7b5 500~600\ucabd\uc774 \ub410\uc744 \uac70 \uac19\uc73c\ub2c8 \uc774\ub7f0 \ubd80\ubd84\uc740 \uc800\uc790\uc758 \uc785\uc7a5\uc774 \uc774\ud574\ub429\ub2c8\ub2e4.\\n\\n## \ub300\uc0c1 \ub3c5\uc790 \\n\\n\ud30c\uc774\uc36c\uc73c\ub85c \uc804\ubc18\uc801\uc778 \ubc31\uc5d4\ub4dc\ub97c \uacbd\ud5d8\ud574\ubcf4\uace0 \uc2f6\uc740 \ubd84\ub4e4\uaed8 \ucd94\ucc9c\ud574 \ub4dc\ub9bd\ub2c8\ub2e4. \uc608\uc804\uc5d4 \ubaa9\ud45c\ud558\ub294 \uc9c1\uad70\uc5d0 \ub300\ud574 \uc9c1\uc811 \uacbd\ud5d8\ud574\ubcf4\uc9c0 \ubabb\ud55c \ubd80\ubd84\ub4e4\uc740 \uc5b4\ub5bb\uac8c \uacf5\ubd80\ud574\uc57c \ud558\ub098 \uace0\ubbfc\ud588\uc744 \ud150\ub370 \ucc45\uc744 \ud1b5\ud558\uc5ec \uc27d\uac8c \uacbd\ud5d8\ud560 \uc218 \uc788\uc5b4\uc11c \uc88b\uc740 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \uac1c\uc778\uc801\uc73c\ub85c \uc774\ub807\uac8c \ud504\ub85c\uc81d\ud2b8 \ud558\ub098\ub97c \uc8fc\uc81c\ub85c \uc804\ubc18\uc801\uc778 \ubd80\ubd84\uc744 \ub2e4\ub8f0 \uc218 \uc788\ub294 \ucc45\ub4e4\uc774 \ub354 \ub9ce\uc774 \ub098\uc640\uc92c\uc73c\uba74 \ud558\ub294 \ubc14\ub78c\uc785\ub2c8\ub2e4."},{"id":"/AttributeError-str-decode","metadata":{"permalink":"/blog/AttributeError-str-decode","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/2021-06-02-AttributeError-str-decode/AttributeError-str-decode.md","source":"@site/blog/2021-06-02-AttributeError-str-decode/AttributeError-str-decode.md","title":"PyJWT \ub808\uac70\uc2dc \ucf54\ub4dc \uc218\uc815","description":"\ud30c\uc774\uc36c \ub808\uac70\uc2dc \uc0bd\uc9c8\uae30\ub85d","date":"2021-06-02T00:00:00.000Z","formattedDate":"2021\ub144 6\uc6d4 2\uc77c","tags":[{"label":"Problem Solving","permalink":"/blog/tags/problem-solving"}],"hasTruncateMarker":true,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\uace0 \uc788\ub294 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"PyJWT \ub808\uac70\uc2dc \ucf54\ub4dc \uc218\uc815","date":"2021-06-02","authors":"teddygood","tags":["Problem Solving"],"draft":false,"slug":"/AttributeError-str-decode","description":"\ud30c\uc774\uc36c \ub808\uac70\uc2dc \uc0bd\uc9c8\uae30\ub85d","keywords":["\ub808\uac70\uc2dc","\ud30c\uc774\uc36c","PyJWT","\uae54\ub054\ud55c \ud30c\uc774\uc36c \ud0c4\ud0c4\ud55c \ubc31\uc5d4\ub4dc"]},"prevItem":{"title":"\uae54\ub054\ud55c \ud30c\uc774\uc36c \ud0c4\ud0c4\ud55c \ubc31\uc5d4\ub4dc","permalink":"/blog/python-backend-flask"},"nextItem":{"title":"Alpine Linux\uc640 crpytography\uc758 \ud638\ud658\uc131 \ubb38\uc81c \ud574\uacb0","permalink":"/blog/python-lib-cryptography"}},"content":"## \uc5d0\ub7ec\\n\\nPyJWT\ub97c \ud65c\uc6a9\ud558\uc5ec JWT(JSON Web Token)\ub97c \ub9cc\ub4e4\uace0 \uc788\uc5c8\ub294\ub370 \uc5d0\ub7ec\uac00 \ub5b4\ub2e4.\\n\\n```python\\ntoken = jwt.encode(payload, app.config[\'JWT_SECRET_KEY\'], \'HS256\')\\n\\nreturn jsonify({\'access_token\': token.decode(\'UTF-8\')})\\n```\\n\\n```bash\\nAttributeError: \'str\' object has no attribute \'decode\'\\n```\\n\\n\\"\ucc45\uc758 \ucf54\ub4dc\uc640 \ub611\uac19\uc774 \uc37c\ub294\ub370 \ubb50\uc9c0?\\"\ub77c\uace0 \uc0dd\uac01\ud558\uba74\uc11c \uc77c\ub2e8 \ucf54\ub4dc\ub97c \uc798\ubabb \uc37c\uc744 \uc218\ub3c4 \uc788\uc73c\ub2c8 \ucc45\uc5d0\uc11c \uc8fc\uc5b4\uc9c4 \ucf54\ub4dc\ub97c \ubcf5\ubd99\ud588\ub2e4. \uadf8\ub798\ub3c4 \uc5d0\ub7ec\ub294 \ub2e4\uc2dc \ub098\ud0c0\ub0ac\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n## \ud574\uacb0\\n\\n\uc5d0\ub7ec\uac00 \ub2e4\uc2dc \ub098\ud0c0\ub098\ub2c8 \ubc29\ubc95\uc740 \uad6c\uae00\ub9c1 \ubc16\uc5d0 \uc5c6\uc5c8\ub2e4. \ubc14\ub85c stackoverflow\uac00 \ub728\uae38\ub798 \ud574\uacb0\uc740 \uae54\ub054\ud558\uac8c \ub410\ub2e4.\\n\\n```python\\ntoken = jwt.encode(payload, app.config[\'JWT_SECRET_KEY\'], \'HS256\')\\n\\nreturn jsonify({\'access_token\': token})\\n```\\n\\n\uadf8\ub0e5 decode\ub97c \uc9c0\uc6cc\uc8fc\uba74 \ub418\ub294 \ubb38\uc81c\uc600\ub2e4. \uadfc\ub370 \'\uc65c decode\uac00 \ubd99\uc5b4\uc788\ub358\uac78\uae4c?\'\ub77c\ub294 \uc758\ubb38\uc774 \ub4e4\uc5c8\uace0 stackoverflow\ub97c \uacc4\uc18d \ud0d0\ud5d8\ud588\ub2e4.\\n\\n![pyjwt-version-stackoverflow](pyjwt-version-stackoverflow.jpg)\\n\\n\ub300\ucda9 \ubc84\uc804\uacfc \uad00\ub828\uc788\uc5b4 \ubcf4\uc774\ub294 \ub2f5\ubcc0\uc744 \ubc1c\uacac\ud588\uace0, \ubc14\ub85c \uacf5\uc2dd\ubb38\uc11c\ub97c \uc77d\uc5b4\ubcf4\ub294 \ubc29\ubc95\uc744 \uc120\ud0dd\ud588\ub2e4. \ud604\uc7ac \ub0b4\uac00 \uc4f0\uace0 \uc788\ub294 \ubc84\uc804\uc740 2.1.0\uc73c\ub85c \uac00\uc7a5 \ucd5c\uadfc \ubc84\uc804\uc774\ub2e4. \uc800 \ucf54\ub4dc\uac00 \ub808\uac70\uc2dc \ucf54\ub4dc\ub77c\ub294 \uc608\uc0c1\uc744 \ud574\ubcf4\uace0 PyJWT \uacf5\uc2dd \ubb38\uc11c\uc758 Changelog\ub97c \uc77d\uc5b4\ubd24\ub2e4.\\n\\n![jwt-encode-return-type](jwt-encode-return-type.jpg)\\n\\n\uc5ed\uc2dc\ub098 \ub0b4 \uc608\uc0c1\uc740 \ub9de\uc558\ub2e4. v2.0.0\uc73c\ub85c \ubc14\ub00c\uba74\uc11c `jwt.encode(...)`\uc758 return type\uc774 \ubc14\ub00c\uc5c8\ub2e4\ub294 \uac83. \uc608\uc804\uc5d0\ub294 \ud1a0\ud070\uc758 \ud0c0\uc785\uc744 byte string\uc73c\ub85c return\ud588\uc5c8\ub358 \uac83 \uac19\ub2e4. \ud604\uc7ac\ub294 str \ud0c0\uc785\uc73c\ub85c return\ub418\uace0 \ud30c\uc774\uc36c\uc5d0\uc11c \ubaa8\ub4e0 \ubb38\uc790\uc5f4\uc740 UTF-8\uc774\ubbc0\ub85c \ub531\ud788 \uc800\uac78 decode\ud560 \ud544\uc694\uac00 \uc5c6\ub2e4\ub294 \uc758\ubbf8\uc774\ub2e4.\\n\\n## \ub290\ub080\uc810\\n\\n\uc5ed\uc2dc \ucc45\uc744 \uc77d\uc73c\uba74\uc11c \uacf5\ubd80\ud558\ub294 \ubc29\ubc95\ub3c4 \uc7a5\uc810\ub9cc \uc788\ub294 \uac83\uc774 \uc544\ub2c8\ub2e4. \uc5bc\ub9c8\ub098 \uc624\ub798 \ub410\ub290\ub0d0\uc5d0 \ub530\ub77c\uc11c \ub808\uac70\uc2dc \ucf54\ub4dc\uac00 \uc874\uc7ac\ud560 \uc218\ub3c4 \uc788\ub2e4. \ucc45\uc73c\ub85c \uacf5\ubd80\ud558\ub824\uba74 \uac00\uc7a5 \ucd5c\uadfc\uc5d0 \ub098\uc628 \ucc45\uc744 \uba3c\uc800 \uc77d\uc5b4\ubcf4\ub294 \uac83\uc774 \uc88b\uc744\ub4ef\ud558\ub2e4.\\n\\n\\n## References\\n\\n>- [Python AttributeError: \'str\' object has no attribute \'decode\'](https://stackoverflow.com/questions/50979667/python-attributeerror-str-object-has-no-attribute-decode) \\n>- [AttributeError: \'str\' object has no attribute \'decode\' python error](https://stackoverflow.com/questions/65798281/attributeerror-str-object-has-no-attribute-decode-python-error/)\\n>- [PyJWT](https://pyjwt.readthedocs.io/en/latest/index.html)"},{"id":"/python-lib-cryptography","metadata":{"permalink":"/blog/python-lib-cryptography","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/2021-06-02-python-lib-cryptography/python-lib-cryptography.md","source":"@site/blog/2021-06-02-python-lib-cryptography/python-lib-cryptography.md","title":"Alpine Linux\uc640 crpytography\uc758 \ud638\ud658\uc131 \ubb38\uc81c \ud574\uacb0","description":"\ud638\ud658 \ubb38\uc81c \ud574\uacb0","date":"2021-06-02T00:00:00.000Z","formattedDate":"2021\ub144 6\uc6d4 2\uc77c","tags":[{"label":"Problem Solving","permalink":"/blog/tags/problem-solving"}],"hasTruncateMarker":true,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\uace0 \uc788\ub294 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"Alpine Linux\uc640 crpytography\uc758 \ud638\ud658\uc131 \ubb38\uc81c \ud574\uacb0","date":"2021-06-02","authors":"teddygood","tags":["Problem Solving"],"draft":false,"slug":"/python-lib-cryptography","description":"\ud638\ud658 \ubb38\uc81c \ud574\uacb0","keywords":["Python","Docker","Alpine Linux","cryptography"]},"prevItem":{"title":"PyJWT \ub808\uac70\uc2dc \ucf54\ub4dc \uc218\uc815","permalink":"/blog/AttributeError-str-decode"},"nextItem":{"title":"PyCharm\uc774 \uc815\ub82c\ud574\uc900 \uc774\uc0c1\ud55c \ucf54\ub4dc","permalink":"/blog/pycharm-reformat-code"}},"content":"## \ubb38\uc81c\\n\\n### Alpine Linux\uc640 cryptography\uc758 \ud638\ud658\uc131 \ubb38\uc81c\\n\\nDjango \ube14\ub85c\uadf8 \ud504\ub85c\uc81d\ud2b8\ub97c docker\ub85c \uc62e\uae30\ub294 \ub3c4\uc911 \uc5d0\ub7ec\uac00 \ub5b4\ub2e4. alpine linux\uc640 python\uc5d0\uc11c \uc554\ud638\ud654 \uc54c\uace0\ub9ac\uc998\uc774 \uad6c\ud604\ub41c \ud328\ud0a4\uc9c0\uc778 cryptography\uc758 \ud638\ud658\uc131 \ubb38\uc81c\uc600\ub2e4. \\n\\n```Dockerfile\\nFROM python:3.8-alpine\\n```\\n\\n```bash\\ncryptography==3.4.7\\n```\\n\\n\ud604\uc7ac Dockerfile\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 image \ubc84\uc804\uacfc requirements.txt\uc5d0 \uc801\ud78c cryptography \ubc84\uc804\uc740 \uc704\uc640 \uac19\ub2e4.\\n\\n```bash\\ndocker-compose build\\n```\\n\\n```\\nERROR: No matching distribution found for cryptography==3.4.7\\n```\\n\\n`Dockerfile`, `docker-compose.yml`\uc744 \ub2e4 \ub9cc\ub4e4\uace0 \ub09c \ud6c4\uc5d0 \ub9c8\uc9c0\ub9c9\uc73c\ub85c \uc704\uc758 \uba85\ub839\uc5b4\ub85c \ube4c\ub4dc\ub97c \ud558\ub358 \uc911 \uc704\uc758 Error\ub97c \ub9cc\ub0ac\ub2e4. \\n\\n### \ube4c\ub4dc\uac00 \uc624\ub798 \uac78\ub9ac\ub294 \ubb38\uc81c\\n\\n![\ub354 \uc0c1\uc138\ud55c details](crypto-building-error.jpg)\\n\\n\uc704\uc758 \uba85\ub839\uc5b4\ub97c Dockerfile\uc5d0 \ucd94\uac00\ud558\uace0 \ub2e4\uc2dc build \ud558\ub2c8 \uc704\uc640 \uac19\uc774 \uc5d0\ub7ec \uc544\ub2cc \uc5d0\ub7ec\uac00 \ub5b4\ub2e4. \uc774\ubbf8\uc9c0\ub97c \ubcf4\uba74 \uc54c \uc218 \uc788\ub4ef\uc774 still running\uc774 \uc9c0\uc18d\ub418\ub294 \uc0c1\ud669\uc774\ub2e4. \ub300\ub7b5 10\ubd84 \uc815\ub3c4 \uadf8\ub300\ub85c \ub194\ub480\ub294\ub370\ub3c4 \ube4c\ub4dc\uac00 \uc548 \ub418\ub294 \uc0c1\ud669\uc774\ub2e4.\\n\\n![\ub354 \uc0c1\uc138\ud55c details](alpine-linux-build-issue.jpg)\\n\\ncryptography GitHub \uc800\uc7a5\uc18c\uc5d0\uc11c \uac00\uc838\uc628 \uc774\uc288 \uc774\ubbf8\uc9c0\ub2e4. \ud604\uc7ac\uc758 \uc0c1\ud669\uacfc \uac19\uae38\ub798 \ub2f5\ubcc0\uc744 \ucc38\uace0\ud558\ub824 \ud588\uc73c\ub098 \ub0b4 \uc9c0\uc2dd\uc73c\ub85c\ub294 \uc774\ud574 \ubd88\uac00\uc600\ub2e4. \ub300\ub7b5 \uc694\uc57d\ud558\uc790\uba74 \ud30c\uc774\uc36c \ud328\ud0a4\uc9c0 \ud3ec\ub9f7\uacfc \uad00\ub828\ub41c \ub2f5\ubcc0\uacfc alpine linux\uc5d0 \ub300\ud574 \uacf5\uc2dd \ubb38\uc11c\ub85c \uc798 \uc815\ub9ac\ub418\uc5b4 \uc788\ub2e4\ub294 \ub0b4\uc6a9\uc774\ub2e4. \uacb0\ub860\uc801\uc73c\ub85c\ub294 \ub3c4\uc6c0\uc774 \uc548 \ub410\uc9c0\ub9cc, \ud639\uc2dc \uc800 \ub2f5\ubcc0\uc73c\ub85c \ud574\uacb0\ud560 \uc218 \uc788\ub294 \ubd84\uc774 \uc788\uc744 \uc218 \uc788\uae30\uc5d0 \uac00\uc838\uc640\ubd24\ub2e4.\\n\\n\ud604 \uc2dc\uc810\uc758 \ubb38\uc81c\ub294 \ube4c\ub4dc\uac00 \uc624\ub798 \uac78\ub9b0\ub2e4\ub294 \uac83\uc774\ub2e4. \uc774 \ubb38\uc81c\ub97c \ud574\uacb0\ud558\uae30 \uc704\ud574 \ub2e4\uc2dc \uad6c\uae00\ub9c1\uc744 \ud558\uba74\uc11c \ub3c4\ucee4\uc5d0 \ub300\ud574 \uacf5\ubd80\ud558\uac8c \ub410\uace0, \ud30c\uc774\uc36c \ud658\uacbd\uc5d0\uc11c \ub3c4\ucee4\ub97c \uc774\uc6a9\ud560 \ub54c \uc5b4\ub5a4 OS\ub97c \uc0ac\uc6a9\ud558\ub294 \uac83\uc774 \ub354 \uc720\ub9ac\ud55c \uac00\uc5d0 \ub300\ud574 \uacf5\ubd80\ud588\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n## \ud574\uacb0\\n\\n### \uccab \ubc88\uc9f8 \ubb38\uc81c \ud574\uacb0\\n\\n![crypto-doc](cryptography-doc.jpg)\\n\\n\uc544\ubb34\ub9ac \uad6c\uae00\ub9c1\uc744 \ud574\ub3c4 \ucc3e\uc9c0\ub97c \ubabb \ud574\uc11c \uacf5\uc2dd \ubb38\uc11c\ub97c \ubcf4\uae30\ub85c \uacb0\uc815\ud588\uace0 \uc5b4\ub290\uc815\ub3c4 \ud574\uacb0\ucc45\uc744 \ucc3e\uc558\ub2e4.\\n\\n\ub300\ub7b5 \uc694\uc57d\ud558\uba74 cryptography \ud328\ud0a4\uc9c0\ub294 Rust\ub97c \uc0ac\uc6a9\ud558\uae30\uc5d0 Rust compiler\ub3c4 \uac19\uc774 \ub2e4\uc6b4\ub85c\ub4dc \ud574\uc57c\uc9c0 \ub3cc\uc544\uac04\ub2e4\ub294 \uac83\uc774\ub2e4. Rust\ub294 cryptography\ub97c \ube4c\ub4dc\ud560 \ub54c \ud544\uc694\ud558\uba70 stackoverflow\uc5d0\uc11c \ucc38\uace0\ud55c \ub2f5\ubcc0\uc5d0\uc11c\ub294 rust \uc124\uce58\ub97c \uc2a4\ud0b5\ud558\ub294 \uba85\ub839\uc5b4\ub97c \ucd94\uac00\ud558\ub294 \ubc29\ubc95\ub3c4 \uc54c \uc218 \uc788\uc5c8\ub2e4.\\n\\n```Dockerfile\\nENV CRYPTOGRAPHY_DONT_BUILD_RUST=1\\n```\\n\\nmulti-stage\ub97c \uc0ac\uc6a9\ud558\uc5ec \ube4c\ub4dc\ud558\ub77c\uace0 \ud55c\ub2e4. \ubb3c\ub860 multi-stage\ub97c \uc0ac\uc6a9\ud558\uba74 \uc774\ubbf8\uc9c0\ub97c \uacbd\ub7c9\ud654\ud558\ub294 \uac83\ub3c4 \uc88b\uc740 \ubc29\ubc95\uc774\uc9c0\ub9cc \ub3c4\ucee4\ub97c \uc790\uc138\ud788 \ubc30\uc6b4 \uc0ac\ub78c\uc774 \uc544\ub2c8\ub77c \uc798 \ubaa8\ub974\uae30 \ub54c\ubb38\uc5d0 \uc774 \ubc29\ubc95\uc740 \ud328\uc2a4\ud588\ub2e4. \\n\\n```shell\\n$ sudo apk add gcc musl-dev python3-dev libffi-dev openssl-dev cargo\\n```\\n\\n\uc704\uc758 \uba85\ub839\uc5b4\ub97c Dockerfile\uc5d0 \ucd94\uac00\ud558\uba74\uc11c \uccab \ubc88\uc9f8 \ubb38\uc81c\ub294 \ub05d\ub0ac\ub2e4.\\n\\n### \ub450 \ubc88\uc9f8 \ubb38\uc81c \ud574\uacb0\\n\\n#### alpine linux\uac00 \ud30c\uc774\uc36c \ud658\uacbd\uc5d0\uc11c \uc801\uc808\ud558\uc9c0 \uc54a\uc740 \uc774\uc720\\n\\n\ub300\ubd80\ubd84\uc758 \uc0ac\ub78c\ub4e4\uc774 \ub3c4\ucee4\ub97c \ucc98\uc74c \uc0ac\uc6a9\ud560 \ub54c alpine linux\ub85c \uc0ac\uc6a9\ud558\ub294\ub370 \uadf8 \uc774\uc720\ub294 Ubuntu linux\uc640 \ube44\uad50\ud588\uc744 \ub54c \uc6a9\ub7c9\ub3c4 \uc791\uace0 \ube4c\ub4dc\ud560 \ub54c \ub354 \ube60\ub974\uae30 \ub54c\ubb38\uc774\ub2e4. \uadf8\ub7ec\ub098 python \ud658\uacbd\uc5d0\uc11c\ub294 \uc801\uc808\ud558\uc9c0 \uc54a\ub2e4.\\n\\n\uadf8 \uc774\uc720\ub294 \uc0ac\uc6a9\ud558\ub294 \ub77c\uc774\ube0c\ub7ec\ub9ac\uc758 \ucc28\uc774\uc5d0\uc11c \uc2dc\uc791\ub41c\ub2e4. \ub300\ubd80\ubd84\uc758 \ub9ac\ub205\uc2a4 \ubc30\ud3ec\ud310\uc740 \ud30c\uc774\uc36c\uc744 \ud3ec\ud568\ud55c \ubaa8\ub4e0 C\uc5b8\uc5b4 \ud504\ub85c\uadf8\ub7a8\uc5d0 \ud544\uc694\ud55c C\uc5b8\uc5b4 \ud45c\uc900 \ub77c\uc774\ube0c\ub7ec\ub9ac\uc778 GNU \ub77c\uc774\ube0c\ub7ec\ub9ac(glibc)\ub97c \uc0ac\uc6a9\ud55c\ub2e4. \uadf8\ub7ec\ub098 Alpine Linux\ub294 \uc880 \ub354 \uacbd\ub7c9\ud654\ud558\uae30 \uc704\ud558\uc5ec GNU \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \uc0ac\uc6a9\ud558\ub294 \uac83\uc774 \uc544\ub2c8\ub77c musl \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \uc0ac\uc6a9\ud55c\ub2e4. \uc774 musl \ub77c\uc774\ube0c\ub7ec\ub9ac\ub294 GNU \ub77c\uc774\ube0c\ub7ec\ub9ac\ub85c \ucef4\ud30c\uc77c \ub41c `Wheel \ubc14\uc774\ub108\ub9ac`\ub97c \uc9c0\uc6d0\ud558\uc9c0 \uc54a\ub294\ub2e4. \uadf8\ub807\uae30 \ub54c\ubb38\uc5d0 `.whl` \ud655\uc7a5\uc790\ub97c \uac16\ub294 \ud328\ud0a4\uc9c0\ub97c \ub2e4\uc6b4 \ubc1b\ub294 \uac83\uc774 \uc544\ub2c8\ub77c `.tar.gz` \ud655\uc7a5\uc790 \ud30c\uc77c\uc744 \ub2e4\uc6b4 \ubc1b\uac8c \ub41c\ub2e4. \uadf8\ub807\uae30 \ub54c\ubb38\uc5d0 alpine linux\ub97c \uc0ac\uc6a9\ud558\ub294 \uacbd\uc6b0 \uc0ac\uc6a9\ud558\ub294 \ubaa8\ub4e0 \ud30c\uc774\uc36c \ud328\ud0a4\uc9c0\uc758 C\ucf54\ub4dc\ub97c \ucef4\ud30c\uc77c \ud574\uc57c \ud558\ubbc0\ub85c \ube4c\ub4dc \uc2dc\uac04\ub3c4 \uc624\ub798 \uac78\ub9ac\uba70 \uc6a9\ub7c9\ub3c4 \ucee4\uc9c4\ub2e4\ub294 \uac83\uc774\ub2e4. \\n\\n\ucd5c\uadfc \ub300\ubd80\ubd84\uc758 \ud30c\uc774\uc36c \ud328\ud0a4\uc9c0\uc5d0\ub294 PyPI\uc758 Wheel \ubc14\uc774\ub108\ub9ac\uac00 \ud3ec\ud568\ub418\uc5b4 \uc788\uc5b4 \uc124\uce58 \uc2dc\uac04\uc774 \ube60\ub974\ub2e4. Wheel\uc740 \uc0ac\uc2e4 .whl \ud655\uc7a5\uc790\uc640 \ud2b9\ubcc4\ud55c \ud615\uc2dd\uc758 \ud30c\uc77c \uc774\ub984\uc73c\ub85c \uc774\ub8e8\uc5b4\uc9c4 ZIP \ud615\uc2dd\uc744 \uc544\uce74\uc774\ube0c\ud55c \uac83\uc774\ub2e4. \uc27d\uac8c \ub9d0\ud558\uba74 \ud655\uc7a5\uc790\ub9cc \ubc14\uafbc \uac83\uc774\ub2e4.\\n\\n1. \ube4c\ub4dc\uac00 \ub290\ub9ac\ub2e4.\\n2. \uc774\ubbf8\uc9c0 \uc6a9\ub7c9\uc774 \ucee4\uc9c4\ub2e4.\\n3. \uc2dc\uac04\uc774 \ub9ce\uc774 \ub0ad\ube44\ub41c\ub2e4.(\ube4c\ub4dc\ud558\ub294 \uacfc\uc815)\\n4. \ub7f0\ud0c0\uc784 \ubc84\uadf8\ub4e4\uc744 \ub9cc\ub0a0 \uc218 \uc788\ub2e4.\\n\\n\uac04\ub2e8\ud558\uac8c \uc694\uc57d\ud558\uc790\uba74 \uc704\uc758 \uc774\uc720\ub4e4\uc774 Alpine Linux\uac00 python \ud658\uacbd\uc5d0\uc11c \uc801\uc808\ud558\uc9c0 \uc54a\uc740 \uc774\uc720\uc774\ub2e4.\\n\\n#### \uadf8\ub7fc \uc5b4\ub5a4 OS\ub97c \uc0ac\uc6a9\ud574\uc57c \ud560\uae4c?\\n\\n\uc131\ub2a5\uc5d0 \uad00\uc2ec \uc788\uc73c\uba74 ubuntu, \uac00\ubccd\uac8c \ub3c4\ucee4\ub97c \uc2dc\uc791\ud574\ubcf4\ub824\uba74 alpine\uc774 \uc88b\uaca0\uc9c0\ub9cc \ud604\uc7ac \ub098\ub294 \ud30c\uc774\uc36c \ud658\uacbd\uc5d0\uc11c \ub3c4\ucee4\ub97c \uc0ac\uc6a9\ud574\ubcf4\ub824 \ud558\ub2c8 Debian buster\ub97c \uae30\ubc18\uc73c\ub85c \ud55c 3.8-slim-buster\ub97c \uc0ac\uc6a9\ud55c\ub2e4.\\n\\n```Dockerfile\\nRUN apk update \\\\\\n&& apk add postgresql-dev gcc python3-dev musl-dev zlib-dev jpeg-dev libffi-dev openssl-dev cargo\\n```\\n\\n```Dockerfile\\nFROM python:3.8-slim-buster\\n```\\n\\n\uc704\uc758 apk\ub85c \ud328\ud0a4\uc9c0 \uc124\uce58\ud55c \ubd80\ubd84\uc758 \uba85\ub839\uc5b4\ub97c \uc9c0\uc6b0\uace0, slim-buster\ub85c \ubc14\uafd4\uc900\ub2e4.\\n\\n\uc774\ud6c4 \ub2e4\uc2dc build \ud588\uc744 \ub54c \uc798 \ub418\ub294 \ubaa8\uc2b5\uc744 \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n## References\\n\\n>- [Cryptography installation](https://cryptography.io/en/latest/installation/)\\n>- [Dependencies to build on Alpine Linux?](https://github.com/pyca/cryptography/issues/5776)\\n>- [\ub3c4\ucee4 \uc774\ubbf8\uc9c0 \uc798 \ub9cc\ub4dc\ub294 \ubc29\ubc95](https://jonnung.dev/docker/2020/04/08/optimizing-docker-images/)\\n>- [Using Alpine can make Python Docker builds 50x slower](https://pythonspeed.com/articles/alpine-docker-python/)\\n>- [The best Dockeer base image for Python application](https://pythonspeed.com/articles/base-image-python-docker-images/)"},{"id":"/pycharm-reformat-code","metadata":{"permalink":"/blog/pycharm-reformat-code","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/2021-05-23-pycharm-reformat-code/pycharm-reformat-code.md","source":"@site/blog/2021-05-23-pycharm-reformat-code/pycharm-reformat-code.md","title":"PyCharm\uc774 \uc815\ub82c\ud574\uc900 \uc774\uc0c1\ud55c \ucf54\ub4dc","description":"IDLE\ub97c \ub108\ubb34 \ubbff\uc9c0\ub294 \ub9d0\uc790","date":"2021-05-23T00:00:00.000Z","formattedDate":"2021\ub144 5\uc6d4 23\uc77c","tags":[{"label":"\uac1c\ubc1c\ud558\ub2e4\uac00 \ub9cc\ub09c \ubb38\uc81c","permalink":"/blog/tags/\uac1c\ubc1c\ud558\ub2e4\uac00-\ub9cc\ub09c-\ubb38\uc81c"}],"hasTruncateMarker":true,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\uace0 \uc788\ub294 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"PyCharm\uc774 \uc815\ub82c\ud574\uc900 \uc774\uc0c1\ud55c \ucf54\ub4dc","date":"2021-05-23","authors":"teddygood","tags":["\uac1c\ubc1c\ud558\ub2e4\uac00 \ub9cc\ub09c \ubb38\uc81c"],"draft":false,"slug":"/pycharm-reformat-code","description":"IDLE\ub97c \ub108\ubb34 \ubbff\uc9c0\ub294 \ub9d0\uc790","keywords":["Python","Pycharm"]},"prevItem":{"title":"Alpine Linux\uc640 crpytography\uc758 \ud638\ud658\uc131 \ubb38\uc81c \ud574\uacb0","permalink":"/blog/python-lib-cryptography"},"nextItem":{"title":"\ub9c8\ud06c\ub2e4\uc6b4(Markdown) \uc815\ub9ac","permalink":"/blog/markdown"}},"content":"## \ubb38\uc81c\\n\\n![\ud30c\uc774\ucc38 HTML \ucf54\ub4dc](pycharm-html-code.jpg)  \\n\\ndjango \uacf5\ubd80\ub97c \ud558\ub358 \ub3c4\uc911 \ud14c\uc2a4\ud2b8 \ucf54\ub4dc\ub97c \uc218\uc815\ud558\uac8c \ub418\uace0 \uadf8\uc5d0 \ub9de\ucdb0 base.html \ucf54\ub4dc\ub3c4 \uc218\uc815\ud560 \ud544\uc694\uac00 \uc788\uc5c8\ub2e4. \uc704\uc640 \uac19\uc774 \ucf54\ub4dc\ub97c \uc801\uc5c8\uace0, \uc704\uc758 \ucf54\ub4dc\ub294 \ud604\uc7ac \ub4e4\uc5ec\uc4f0\uae30\uac00 \uc5c4\uccad \ub9ce\uc774 \uc0ac\uc6a9\ub41c \uc0c1\ud669. \uc791\uc740 \ubaa8\ub2c8\ud130\ub97c \uc4f0\ub358 \ub09c \ub2f9\uc5f0\ud788 Ctrl+Alt+l\uc744 \ub20c\ub800\ub2e4. (Ctrl+Alt+l\uc740 Pycharm\uc758 Reformat and rearrange code\uc774\ub2e4.)\\n\\n![\uc815\ub82c\ub41c \ucf54\ub4dc 1](pycharm-reformat-code-1.jpg)  \\n\\n\uc704\uc640 \uac19\uc774 \uc815\ub82c\ub41c \uac83\uc744 \ubcf4\uace0 \\"\uc798 \ub410\ub124\\"\ub77c\uace0 \uc0dd\uac01\ud558\uba74\uc11c \uc544\ubb34\ub7f0 \uc758\uc2ec \uc5c6\uc774 \uc9c0\ub098\uac14\uc5c8\ub2e4. \uadf8 \ud6c4 \ucc98\uc74c \ud14c\uc2a4\ud2b8\ub97c \ud560 \ub54c\ub294 \ubb34\uc2a8 \ubb38\uc81c\uac00 \uc788\ub098 \uc0dd\uac01\ud588\uc9c0\ub9cc, \uc810\uc810 \ud14c\uc2a4\ud2b8\ub97c \ud560 \ub54c\ub9c8\ub2e4 FAIL\uc774 \ub728\ub294 \uac83\uc744 \ubcf4\uba70 \uc815\uc2e0 \ub098\uac08 \uac70 \uac19\uc558\ub2e4.\\n\\n![\uc810\uc2ec \ub098\uac00\uc11c \uba39\uc744 \uac70 \uac19\uc544](my-code-doesnt-work.jpg)  \\n\\n\uc9c4\uc9dc \ub531 \uc800 \uc720\uba38\uc600\ub2e4. \uc790\uafb8 \\"\uc544\ub2c8, \uc774\uac8c \uc65c \uc548 \ub3fc?\\"\ub77c\ub294 \uc0dd\uac01\ub9cc \ub4e4\uba74\uc11c \ud14c\uc2a4\ud2b8 \ucf54\ub4dc\ub3c4 \uac08\uc544\uc5ce\uace0 html \ucf54\ub4dc\ub3c4 \uc77d\uc5b4\ubcf4\uba74\uc11c \uc5b4\ub514\uac00 \uc798\ubabb \ub410\ub098 \uacc4\uc18d \ucc3e\uc544\ubd24\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n## \ud574\uacb0\\n\\n1\uc2dc\uac04\uc774 \uc9c0\ub09c \ud6c4\uc5d0\uc57c `<a>`\ud0dc\uadf8\uac00 \uc911\uac04\uc5d0 \ub098\ub220\uc9c4 \uac83\uc744 \ud655\uc778\ud558\uc600\uace0 \'\uc5d0\uc774, \uc124\ub9c8\'\ub77c\ub294 \uc0dd\uac01\uc5d0 \uac00\uc7a5 \ucc98\uc74c\uc758 \ucf54\ub4dc\ub85c \uace0\ucce4\ub294\ub370 \ub410\ub2e4.\\n\\n\uad04\ud638\ub4e4\uc744 \ub108\ubb34 \ub9ce\uc774 \uc368\uc11c \uc800\ub807\uac8c \uc815\ub82c\ub41c \uac83\uc744 \ubabb \ucc3e\uace0 \uc788\ub358 \uac83\uc774\ub2e4. \ucc98\uc74c \ucf54\ub4dc\ub85c \uace0\uce58\ub2c8 \uc798 \ub3cc\uc544\uac00\ub354\ub77c...\\n\\n![\uc815\ub82c\ub41c \ucf54\ub4dc 2](pycharm-reformat-code-2.jpg)  \\n\\n\uc704\uc640 \uac19\uc774 \ucf54\ub4dc\ub97c \uc368\ub3c4 \uc798 \ub3cc\uc544\uac04\ub2e4. `<a>` \ud0dc\uadf8 \uc548\uc758 \ub0b4\uc6a9\uc774 \ub098\ub220\uc9c4 \ucc44\ub85c \uc815\ub82c\ub418\ub2c8 \uc774\ub7f0 \ubb38\uc81c\uac00 \uc0dd\uae34 \uac83\uc774\ub2e4. \\n\\nIDLE\uac00 \uae34 \ucf54\ub4dc\ub4e4\uc744 \uc54c\uc544\uc11c \uc798 \uc815\ub9ac\ud574\uc904 \uc904 \uc54c\uc558\ub294\ub370 \uadf8\uac8c \uc544\ub2c8\uc5c8\ub2e4. IDLE\ub97c \ub108\ubb34 \ubbff\uc5c8\ub098. \uc608\uc804\uc5d0 Visual Studio\uc5d0\uc11c\ub3c4 \uc774\ub7f0 \uc2e4\uc218\ub97c \ud55c \uc801\uc774 \uc788\uc5c8\ub294\ub370, \uc870\uc2ec\ud560 \ud544\uc694\uac00 \uc788\ub294 \uac83 \uac19\ub2e4. \uad50\uc218\ub2d8\ub4e4\ub3c4 \ud56d\uc0c1 IDLE\ub97c \ub108\ubb34 \ubbff\uc9c0 \ub9d0\ub77c\uace0 \ud558\uc168\ub294\ub370 \uadf8 \ub9d0\uc774 \uac11\uc790\uae30 \uc0dd\uac01\ub09c\ub2e4."},{"id":"/markdown","metadata":{"permalink":"/blog/markdown","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/2021-01-01-markdown/markdown.md","source":"@site/blog/2021-01-01-markdown/markdown.md","title":"\ub9c8\ud06c\ub2e4\uc6b4(Markdown) \uc815\ub9ac","description":"\ubb38\uc11c\ud654\uc5d0 \uc775\uc219\ud574\uc9c0\uae30 \uc704\ud55c Markdown \uc815\ub9ac","date":"2021-01-01T00:00:00.000Z","formattedDate":"2021\ub144 1\uc6d4 1\uc77c","tags":[{"label":"Blog","permalink":"/blog/tags/blog"}],"hasTruncateMarker":true,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\uace0 \uc788\ub294 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"\ub9c8\ud06c\ub2e4\uc6b4(Markdown) \uc815\ub9ac","date":"2021-01-01","authors":"teddygood","tags":["Blog"],"draft":false,"slug":"/markdown","description":"\ubb38\uc11c\ud654\uc5d0 \uc775\uc219\ud574\uc9c0\uae30 \uc704\ud55c Markdown \uc815\ub9ac","keywords":["Markdown","Blog"]},"prevItem":{"title":"PyCharm\uc774 \uc815\ub82c\ud574\uc900 \uc774\uc0c1\ud55c \ucf54\ub4dc","permalink":"/blog/pycharm-reformat-code"}},"content":"\uc624\ub79c\ub9cc\uc5d0 \ube14\ub85c\uadf8\ub97c \ub2e4\uc2dc \uc2dc\uc791\ud558\ub2e4 \ubcf4\ub2c8 \ub9c8\ud06c\ub2e4\uc6b4\uc5d0 \uc775\uc219\ud558\uc9c0 \uc54a\uc740 \ubaa8\uc2b5\uc774 \ubcf4\uc5ec \ubb38\uc11c\ud654 \ud558\uba74\uc11c \uc5f0\uc2b5\ud55c\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n## Markdown\uc774\ub780?\\n\\n\ub9c8\ud06c\ub2e4\uc6b4(markdown)\uc740 \uc77c\ubc18 \ud14d\uc2a4\ud2b8 \ubb38\uc11c\uc758 \uc591\uc2dd\uc744 \ud3b8\uc9d1\ud558\ub294 \ubb38\ubc95\uc774\ub2e4. GitHub\uc758 README \ud30c\uc77c\uc774\ub098 \uc628\ub77c\uc778 \ubb38\uc11c, \ud639\uc740 \uc77c\ubc18 \ud14d\uc2a4\ud2b8 \ud3b8\uc9d1\uae30\ub85c \ubb38\uc11c\ub4e4\uc744 \ud3b8\uc9d1\ud560 \ub54c \uc4f0\uc778\ub2e4. \ub9c8\ud06c\ub2e4\uc6b4\uc744 \uc774\uc6a9\ud574 \uc791\uc131\ub41c \ubb38\uc11c\ub294 \uc27d\uac8c HTML \ub4f1 \ub2e4\ub978 \ubb38\uc11c\ud615\ud0dc\ub85c \ubcc0\ud658\uc774 \uac00\ub2a5\ud558\ub2e4. \uc989, \uac1c\ubc1c\uc790\ub4e4\uc774 \uc27d\uac8c \ubb38\uc11c\ud654\ub97c \ud560 \uc218 \uc788\ub3c4\ub85d \ub3c4\uc640\uc8fc\ub294 \uc5b8\uc5b4\uc774\ub2e4. \\n\\n## \ubb38\ubc95\uc744 \uadf8\ub300\ub85c \ubcf4\uc5ec\uc8fc\uace0 \uc2f6\uc744 \ub54c\\n\\n\ub9c8\ud06c\ub2e4\uc6b4 \ubb38\ubc95 \uc55e\uc5d0 `\\\\`\ub97c \ubd99\uc5ec\uc8fc\uba74 \ubb38\ubc95 \uadf8\ub300\ub85c\ub97c \ubcf4\uc5ec\uc900\ub2e4.\\n\\n```\\n\\\\### \uc548\ub155\\n```\\n\\n\\\\### \uc548\ub155\\n\\n## \ucf54\ub4dc \ube14\ub85d\\n\\n\\\\```\uc5b8\uc5b4 \uc774\ub984  \\n\ucf54\ub4dc  \\n\\\\```\\n\\n```c\\n#include <stdio.h>\\n\\nint main(void)\\n{\\n    printf(\\"Hello World!\\");\\n}\\n```\\n\\n## \ud14d\uc2a4\ud2b8\\n\\n```\\n*\uc774\ud0e4\ub9ad\uccb4(\uae30\uc6b8\uac8c)*\\n_\uc774\ud0e4\ub9ad\uccb4(\uae30\uc6b8\uac8c)_\\n**\uad75\uac8c**\\n__\uad75\uac8c__\\n~~\ucde8\uc18c\uc120~~\\n```\\n\\n*\uc774\ud0e4\ub9ad\uccb4*\\n_\uc774\ud0e4\ub9ad\uccb4_\\n**\uad75\uac8c**\\n__\uad75\uac8c__\\n~~\ucde8\uc18c\uc120~~\\n\\n\ubc11\uc904\uc774\ub098 \uae00\uc528 \uc0c9\uc740 HTML, CSS\ub97c \uc0ac\uc6a9\ud558\uc790.\\n\\n## \ud5e4\ub354\\n\\n`# ~ ######`\ub85c h1 ~ h6\uae4c\uc9c0\uc758 \uc81c\ubaa9 \ud06c\uae30\ub97c \ud45c\uae30\ud560 \uc218 \uc788\ub2e4. \\n\\n```\\n# This is a h1\\n## This is a h2\\n### This is a h3\\n#### This is a h4\\n##### This is a h5\\n###### This is a h6\\n```\\n\\n# This is a h1\\n## This is a h2  \\n### This is a h3\\n#### This is a h4\\n##### This is a h5\\n###### This is a h6  \\n\\n######## This is a h7 -> \uc9c0\uc6d0\ud558\uc9c0 \uc54a\ub294\ub2e4.  \\n\\nh2\ub97c \ubcf4\uba74 \uc544\ub798\uc5d0 \uad6c\ubd84\uc120\uc774 \uadf8\uc5b4\uc9c0\ub294 \ubaa8\uc2b5\uc744 \ud655\uc778\ud560 \uc218 \uc788\ub294\ub370 minimal-mistakes \ud14c\ub9c8\uc758 scss\uc5d0\uc11c \uc815\uc758\ub418\uace0 \uc788\uae30 \ub54c\ubb38\uc774\ub2e4. \uc774 \ubd80\ubd84\uc740 \uc774\ub300\ub85c \ub194\ub458\uc9c0 \uc218\uc815\ud560\uc9c0 \uace0\ubbfc \uc911\uc774\ub2e4.\\n\\n## \ub9ac\uc2a4\ud2b8\\n\\n### \uc21c\uc11c \uc788\ub294 \ub9ac\uc2a4\ud2b8\\n\\n1. 1\ubc88\\n2. 2\ubc88\\n3. 3\ubc88\\n\\n```\\n1. 1\ubc88\\n1. 2\ubc88\\n1. 3\ubc88\\n```\\n`1.`\ucc98\ub7fc \ud3c9\uc18c \uc4f0\ub358\ub300\ub85c \uc4f0\uba74 \ub41c\ub2e4. \uadf8\ub807\uc9c0\ub9cc \uc704\uc758 \ucf54\ub4dc \ube14\ub85d\uc758 \uc608\uc2dc\ucc98\ub7fc \uac19\uc740 \uc22b\uc790\ub97c \uc5f0\uc18d\ud574\uc11c \uc4f0\ub354\ub77c\ub3c4 \ub0b4\ub9bc\ucc28\uc21c\uc73c\ub85c \ud45c\uae30\ub41c\ub2e4.\\n\\n### \uc21c\uc11c \uc5c6\ub294 \ubaa9\ub85d(\uae00\uba38\ub9ac \uae30\ud638: `*`, `+`, `-`)\\n\\n```\\n- \ub098\ub294\\n  + \ud68c\ub97c\\n  * \uce58\ud0a8\uc744\\n    + \uba39\uace0\uc2f6\ub2e4.\\n```\\n\\n- \ub098\ub294\\n  + \ud68c\ub97c\\n  * \uce58\ud0a8\uc744\\n    + \uba39\uace0\uc2f6\ub2e4.\\n\\n\uae00\uba38\ub9ac \uae30\ud638\ub97c \ud55c \ubb38\uc790\ub85c \ud574\ub3c4 \ub418\uba70 \uc704\uc758 \uc608\uc2dc\ucc98\ub7fc \ud63c\ud569\ud574\uc11c \uc0ac\uc6a9\ud558\ub294 \uac83\ub3c4 \uac00\ub2a5\ud558\ub2e4.\\n\\n## \uac1c\ud589 \ub610\ub294 \uc904\ubc14\uafc8\\n\\nHTML\uc5d0\uc11c\ub294 `<br>`\ub97c \uc0ac\uc6a9\ud558\uc9c0\ub9cc Markdown\uc5d0\uc11c\ub294 Space bar\ub97c 2\ubc88 \ub204\ub978 \ud6c4 Enter\ub97c \ub204\ub974\uba74 \uac1c\ud589\uc774 \ub41c\ub2e4. \\n\\n```\\n\ubc30\uace0\ud504\ub2e4  \\n\uba39\uace0\uc2f6\ub2e4\\n```\\n\\n\ubc30\uace0\ud504\ub2e4  \\n\uba39\uace0\uc2f6\ub2e4  \\n\\n## \uc218\ud3c9\uc120\\n\\nHTML\uc5d0\uc11c\uc758 `<hr>`\uc774\ub2e4. \uae00\uc744 \uc4f0\ub2e4\uac00 \uad6c\ubd84\ud558\ub294 \uc120\uc73c\ub85c \ub9ce\uc774 \uc4f0\uc778\ub2e4. \uc989, \ud398\uc774\uc9c0 \ub098\ub204\uae30 \uc6a9\ub3c4\uc774\ub2e4. `---`, `***`\ub85c \uc4f0\uc774\uc9c0\ub9cc \uc544\ub798\uc640 \uac19\uc774 \uc870\uae08 \uc774\uc0c1\ud55c \ubb38\ubc95\ub3c4 \ud5c8\uc6a9\ud574\uc8fc\ub294 \uac83 \uac19\ub2e4.\\n\\n```\\n* * * \\n***\\n******\\n- - -\\n---\\n___\\n```\\n\\n---\\n***\\n\\n## \uc778\uc6a9\ubb38\\n\\n`>`\ub97c \uc0ac\uc6a9\ud558\uc5ec \ud45c\uae30\ud560 \uc218 \uc788\ub2e4. \uc608\uc2dc\uc640 \uac19\uc774 \uc911\ucca9\ub41c \uc778\uc6a9\ubb38\uc5d0\uc11c \uac1c\ud589\uc744 \ud558\uace0 \uc2f6\ub2e4\uba74 \uc704\uc5d0\uc11c \uc0ac\uc6a9\ud55c \uac83\ucc98\ub7fc \uac1c\ud589\uc744 \uc0ac\uc6a9\ud558\uba74 \ub41c\ub2e4. \\n\\n```\\n> \uc778\uc6a9\ubb38\\n>> \uc778\uc6a9\ubb38 \uc548\uc758 \uc778\uc6a9\ubb38   \\n2\ubc88\uc9f8 \uc778\uc6a9\ubb38\uc73c\ub85c \ub4e4\uc5b4\uac08\ub798\\n>>> \uc778\uc6a9\ubb38 \uc548\uc758 \uc778\uc6a9\ubb38 \uc548\uc758 \uc778\uc6a9\ubb38\\n```\\n\\n> \uc778\uc6a9\ubb38\\n>> \uc778\uc6a9\ubb38 \uc548\uc758 \uc778\uc6a9\ubb38  \\n2\ubc88\uc9f8 \uc778\uc6a9\ubb38\uc73c\ub85c \ub4e4\uc5b4\uac08\ub798\\n>>> \uc778\uc6a9\ubb38 \uc548\uc758 \uc778\uc6a9\ubb38 \uc548\uc758 \uc778\uc6a9\ubb38\\n\\n## \ub9c1\ud06c\\n\\n\ubb38\uc11c\uc5d0 \ub9c1\ud06c\ub97c \ucd94\uac00\ud558\ub294 \ubc29\ubc95\uc774\ub2e4. \uc774 \ubc29\ubc95\ub4e4 \uc774\uc678\uc5d0\ub3c4 \ub2e4\ub978 \ubc29\ubc95\ub4e4\uc774 \uc874\uc7ac\ud560 \uc218 \uc788\ub2e4. \\n\\n```\\nURL\uc744 \ubcf4\uc5ec\uc8fc\ub294 \ub9c1\ud06c: <https://www.google.com/>  \\n\\n\uc124\uba85\uc548\uc5d0 URL\uc774 \ud3ec\ud568\ub418\uc5b4 \uc788\ub294 \ub9c1\ud06c: [Google](https://www.google.com/)  \\n\\n\ub3d9\uc77c \ud30c\uc77c \ub0b4\uc5d0\uc11c \ud5e4\ub354 \uc774\ub3d9 \ub9c1\ud06c: [\uc778\uc6a9\ubb38](#\uc778\uc6a9\ubb38)  \\n```\\n\\n<https://www.google.com/>  \\n[Google](https://www.google.com/)  \\n[\uc778\uc6a9\ubb38](#\uc778\uc6a9\ubb38)  \\n\\n\ud5e4\ub354\ub85c \uc774\ub3d9\ud558\ub294 \ub9c1\ud06c \ub9cc\ub4dc\ub294 \ubc29\ubc95\\n\\n1. \ud5e4\ub354\ub97c \uc81c\uc678\ud558\uace0 \uc81c\ubaa9 \ubb38\uc790\uc5f4\uc744 \ubcf5\uc0ac\ud55c\ub2e4.\\n   \\n2. \ud2b9\uc218 \ubb38\uc790\ub97c \uc81c\uac70\ud55c\ub2e4.\\n\\n3. \uacf5\ubc31\uc744 `-`\ub85c \ubcc0\uacbd\ud55c\ub2e4.\\n\\n4. \ub300\ubb38\uc790\ub294 \uc18c\ubb38\uc790\ub85c \ubcc0\uacbd\ud55c\ub2e4.\\n\\n5. \ubb38\uc790\uc5f4\uc758 \uac00\uc7a5 \uc55e\uc5d0 #\uc744 \ubd99\uc5ec\uc900\ub2e4.\\n\\ne.g. \\"## \ubb38\ubc95\uc774 \uae30\uc5b5\ub098\uc9c0 \uc54a\uac70\ub098 \uc751\uc6a9\ud558\uace0 \uc2f6\uc744 \ub54c\\" -> \\"#\ubb38\ubc95\uc774-\uae30\uc5b5\ub098\uc9c0-\uc54a\uac70\ub098-\uc751\uc6a9\ud558\uace0-\uc2f6\uc744-\ub54c\\" \\n\\n## \uc774\ubbf8\uc9c0\\n\\n```\\n![\ud504\ub85c\ud544](profile.jpg)\\n\\n<img src=\\"profile.jpg\\" width=\\"300\\" height=\\"200\\">\\n\\n[![\ud504\ub85c\ud544](profile.jpg)](https://teddygood.github.io/)\\n```\\n\\n![\uc5f0\ud544](profile.jpg)\\n\\n[![\uc5f0\ud544](profile.jpg)](https://teddygood.github.io/)\\n\\n\uc774\ubbf8\uc9c0\ub294 \ub0b4\uac00 \uc9c1\uc811 \ub300\ud559\uc5d0\uc11c \ucc0d\uc740 \ub2ec.\\n\\n## \ud14c\uc774\ube14\\n\\n`|`\uc640 `-`\uc758 \uc870\ud569\uc73c\ub85c \ud14c\uc774\ube14\uc744 \ub9cc\ub4e4 \uc218 \uc788\ub2e4.\\n\\n- \uc815\ub82c\\n  * \uc67c\ucabd \uc815\ub82c |:\u2014|\\n  * \uc624\ub978\ucabd \uc815\ub82c |\u2014:|\\n  * \uac00\uc6b4\ub370 \uc815\ub82c |:\u2014:|\\n\\n|\uc74c\uc2dd|\uac00\uaca9|\ud3c9\uac00|  \\n|:---:|---:|---|  \\n|\uce58\ud0a8+\uce58\uc988\ubcfc|25000|\ub9db\uc788\uc5b4|  \\n|\uc300\uad6d\uc218|7000|\ub9db\uc5c6\uc5b4|\\n\\n## \ubb38\ubc95\uc774 \uae30\uc5b5\ub098\uc9c0 \uc54a\uac70\ub098 \uc751\uc6a9\ud558\uace0 \uc2f6\uc744 \ub54c \\n\\n\uc774\ub7f4 \ub54c\ub294 Markdown\uacfc HTML/CSS\ub97c \uc11e\uc5b4 \uc4f0\uba74 \ub41c\ub2e4. \uc608\ub97c \ub4e4\uc5b4 \uc904\ubc14\uafc8\uc774 \uc801\uc6a9\uc774 \uc548 \ub41c\ub2e4\uba74 `<br>` \ud0dc\uadf8\ub97c \uc0ac\uc6a9\ud558\uba74 \ub41c\ub2e4. \uc774\uc678\uc5d0\ub3c4 \uae00\uc528\uc758 \uc0c9\uc744 \ubc14\uafb8\uac70\ub098 \ubc11\uc904 \ub4f1\uc744 \uc0ac\uc6a9\ud558\uace0 \uc2f6\uc73c\uba74 HTML\uacfc CSS\ub97c \uc0ac\uc6a9\ud558\uba74 \ub41c\ub2e4. \\n\\n## Official Documents\\n\\n>- [Markdown](https://daringfireball.net/projects/markdown/)\\n\\n## References\\n\\n>- [\uc704\ud0a4\ud53c\ub514\uc544 \ub9c8\ud06c\ub2e4\uc6b4](https://ko.wikipedia.org/wiki/%EB%A7%88%ED%81%AC%EB%8B%A4%EC%9A%B4)\\n\\n>- [\ub9c8\ud06c\ub2e4\uc6b4 \ubb38\ubc95 \ucd1d \uc815\ub9ac](https://ansohxxn.github.io/blog/markdown/#%EA%B8%80%EC%94%A8-%EC%83%89)\\n\\n>- [\ub9c8\ud06c\ub2e4\uc6b4 \uc0ac\uc6a9\ubc95 \ubc0f \uc608\uc81c](https://theorydb.github.io/envops/2019/05/22/envops-blog-how-to-use-md/#markdown%EC%9D%B4%EB%9E%80)\\n\\n>- [\ub9c8\ud06c\ub2e4\uc6b4 \uc791\uc131\ubc95](https://gist.github.com/ihoneymon/652be052a0727ad59601)"}]}')}}]);